fragment:
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:planetary_structural_layer rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :planet ],
        :layer ;
    :has_definition "A planetary structural layer is laminar part of a terrestrial planet or other rocky body large enough to have differentiation by density. Planetary layers have differing physicochemical properties and composition." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:planetary_mantle rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :planetary_crust ],
        :planetary_structural_layer ;
    :has_broad_synonym "mantle" ;
    :has_definition "A planetary mantle is a planetary layer which is an interior part of a terrestrial planet or other rocky body large enough to have differentiation by density." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:planetary_core rdfs:subClassOf :planetary_structural_layer ;
    :has_broad_synonym "core" ;
    :has_definition "A planetary core is the innermost structural layer or layers of a planet. The core may be entirely liquid, entirely solid, or have both liquid and solid parts." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:liquid_planetary_core rdfs:subClassOf :liquid_layer,
        :planetary_core ;
    :has_definition "A liquid planetary core is a planetary core which is primarily composed of liquid material." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:solid_planetary_core rdfs:subClassOf :planetary_core,
        :solid_layer ;
    :has_definition "A solid planetary core is a planetary core which is primarily composed of solid material." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lithosphere rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :planetary_crust ],
        [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :inflexible ],
        [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom [ a owl:Restriction ;
                    owl:onProperty :part_of ;
                    owl:someValuesFrom [ owl:intersectionOf [ rdf:first :planetary_mantle ;
                                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                                    owl:onProperty :has_quality ;
                                                    owl:someValuesFrom :quality_of_a_solid ] ;
                                            rdf:rest :nil ] ] ] ] ],
        :planetary_structural_layer,
        :solid_layer ;
    :has_definition "A lithosphere is the outermost shell of a terrestrial-type planet or natural satellite that is defined by its rigid mechanical properties." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:asthenosphere rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :viscous ],
        [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :lithosphere ],
        [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :decreased_strength ],
        :planetary_structural_layer ;
    :has_definition "An asthenosphere is a layer of a terrestrial-type planet or natural satellite which is highly viscous, mechanically weak, and ductilely deforming." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:magma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :environmental_material ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_quality ;
                                            owl:someValuesFrom :quality_of_a_liquid ] ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :located_in ;
            owl:someValuesFrom :planetary_structural_layer ],
        [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :increased_temperature ],
        :environmental_material ;
    :has_definition "Magma is a mixture of molten or semi-molten rock, volatiles, and solids that is found beneath the uppermost solid layer of a planetary body. Besides molten rock, magma may also contain suspended crystals, dissolved gas and sometimes gas bubbles." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:trench rdfs:subClassOf :depressed_landform ;
    :has_definition "A trench is a type of excavation or depression in the ground that is generally deeper than it is wide (as opposed to a wider gully or ditch), and narrow compared to its length (as opposed to a simple hole)." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:stream_channel rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :location_of ;
            owl:someValuesFrom :stream ],
        :channel_of_a_watercourse ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :channel_of_a_watercourse ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :location_of ;
                                    owl:someValuesFrom :stream ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A channel of a watercourse which contains a stream."@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ocean_strait rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :location_of ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :sea_water ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :connects ;
                                            owl:someValuesFrom [ owl:unionOf [ rdf:first :ocean ;
                                                            rdf:rest [ rdf:first :sea ;
                                                                    rdf:rest :nil ] ] ] ] ;
                                    rdf:rest :nil ] ] ] ],
        :strait ;
    :has_definition "An ocean strait is a strait which connects two oceans." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:river_channel rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :location_of ;
            owl:someValuesFrom :river ],
        :stream_channel ;
    :has_definition "A stream channel which contains a river."@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:slum rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :urban_biome ],
        [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :city ],
        :dense_settlement ;
    :has_definition "A slum is a heavily populated urban informal settlement with substandard housing in which households lack any one of the following: access to improved water, access to improved sanitation, sufficient-living area, durability of housing, or security of tenure." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:undersea_trough rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :ocean_floor ;
                            rdf:rest [ rdf:first :sea_floor ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :ocean ;
                            rdf:rest [ rdf:first :sea ;
                                    rdf:rest :nil ] ] ] ],
        :trough ;
    :has_definition "An undersea trough is a trough which is below a marine water body."^^xsd:string ;
    :has_related_synonym "deep"^^xsd:string,
        "foredeep"^^xsd:string,
        "swale"^^xsd:string .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:explosive_eruption rdfs:subClassOf :volcanic_eruption ;
    :has_definition "An explosive eruption is a volcanic process in which pressurised magma is violently expelled and froths into volcanic ash. Explosive eruptions can eject a cloud of rocks, dust, gas, and pyroclastic material  which may then collapse, creating a pyroclastic flow of hot volcanic matter." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:effusive_eruption rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_output ;
            owl:someValuesFrom :lava ],
        [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :lava_flow_process ],
        :volcanic_eruption ;
    :has_definition "An effusive eruption is a volcanic eruption during which lava flows onto the ground." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:igneous_intrusion_process rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_output ;
            owl:someValuesFrom :igneous_intrusion ],
        [ a owl:Restriction ;
            owl:onProperty :has_input ;
            owl:someValuesFrom :magma ],
        :rock_precursor_intrusion_process ;
    :has_definition "A process whereby rising magma cools and solidifies without reaching the surface. Instead, the cooled and solidified igneous mass crystallises within the crust to form an igneous intrusion." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:dense_settlement rdfs:subClassOf :populated_place ;
    :has_definition "A settlement with a high density of buildings and inhabitants." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:igneous_intrusion rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :mineral_material ],
        [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :igneous_rock ],
        :rock_intrusion ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :rock_intrusion ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :composed_primarily_of ;
                                    owl:someValuesFrom :igneous_rock ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An igneous intrusion is a mass of rock and minerals formed when magma cools, solidifies, and undergoes fractional crystallisation without reaching the surface." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:tephra rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :output_of ;
            owl:someValuesFrom :explosive_eruption ],
        [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :broken ],
        :environmental_material ;
    :has_definition "Tephra is fragmental material produced by a volcanic eruption regardless of composition, fragment size or emplacement mechanism." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:tuff rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :output_of ;
            owl:someValuesFrom :volcanic_eruption ],
        :rock ;
    :has_definition "Tuff is a type of rock made of volcanic ash ejected from a vent during a volcanic eruption." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:scoria rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :output_of ;
            owl:someValuesFrom :volcanic_eruption ],
        :rock ;
    :has_definition "Scoria is a highly vesicular, dark colored volcanic rock that may or may not contain crystals." ;
    :has_exact_synonym "cinder" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pumice rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :output_of ;
            owl:someValuesFrom :volcanic_eruption ],
        :rock ;
    :has_definition "Pumice is a volcanic rock that consists of highly vesicular rough textured volcanic glass, which may or may not contain crystals." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:tuff_cone rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :tuff ],
        [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :ash_cone ],
        :volcanic_cone ;
    :has_definition "A cone that is composed of consolidated volcanic ash." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:waste_role rdfs:subClassOf :role ;
    :has_definition "A role that is realized in some process wherein the bearer is discarded or not utilized further." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:area_of_open_water rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :planetary_surface ],
        [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :water_body ],
        [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :atmospheric_boundary_layer ],
        :environmental_zone ;
    :alternative_term "open water" ;
    :has_definition "An area of a planet's surface which is primarily composed of water in contact with an atmospheric column extending from the planetary boundary layer to the planet's exosphere with little to no physical obstruction." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:geological_fracture rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :located_in ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :environmental_material ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_quality ;
                                            owl:someValuesFrom :quality_of_a_solid ] ;
                                    rdf:rest :nil ] ] ] ],
        :solid_astronomical_body_part ;
    :has_broad_synonym "fracture" ;
    :has_definition "A geological fracture is any separation in a geologic formation, such as a joint or a fault that divides a mass of rock into two or more pieces." ;
    :has_related_synonym "fissure" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:geological_fault rdfs:subClassOf :geological_fracture ;
    :has_broad_synonym "fault" ;
    :has_definition "A geological fault is a planar fracture or discontinuity in a volume of rock, across which there has been significant displacement as a result of rock mass movement." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:active_geological_fault rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :participates_in ;
            owl:someValuesFrom :tectonic_movement ],
        :geological_fault ;
    :has_definition "An active fault is a fault that is likely to become the source of another earthquake sometime in the future. Geologists commonly consider faults to be active if there has been movement observed or evidence of seismic activity during the last 10,000 years." ;
    :has_exact_synonym "active fault" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:vein rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :location_of ;
            owl:someValuesFrom :mineral_material ],
        :geological_fracture ;
    :has_definition "A vein is a geological fracture which is filled with minerals precipitated out of an aqueous solution." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:dike rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :igneous_rock ;
                            rdf:rest [ rdf:first :sedimentary_rock ;
                                    rdf:rest :nil ] ] ] ],
        :rock_intrusion ;
    :has_definition "A sheet of rock that formed in a fracture in a pre-existing rock body." ;
    :has_exact_synonym "dyke" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:geological_joint rdfs:subClassOf :geological_fracture ;
    :has_broad_synonym "joint" ;
    :has_definition "A joint is a geological fracture which has no measureable shear displacement" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:shear_fracture rdfs:subClassOf :geological_fracture ;
    :has_definition "A geological fracture across which shear displacement has occurred" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:microfracture rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :decreased_size ],
        :geological_fracture ;
    :has_definition "A microfracture is a small fracture which is found in a portion of solid material along which further fracturing tends to occur. Microfractures are considered imperfections which to pre-exist any fractures formed by the application of stress to a material." ;
    :has_exact_synonym "Griffith crack" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:atmospheric_column rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :outer_space ],
        [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :planetary_surface ],
        [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :columnar ],
        :gaseous_part_of_an_atmosphere ;
    :has_definition "A vertical pillar defined by a unit area on a planetary surface and bounded by the top of the atmosphere that is used to quantify an atmospheric parameter such as pressure, ozone or precipitable water." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:contaminated_air rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_increased_levels_of ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :chemical_entity ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_role ;
                                            owl:someValuesFrom :environmental_contaminant ] ;
                                    rdf:rest :nil ] ] ] ],
        :air ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :air ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_increased_levels_of ;
                                    owl:someValuesFrom [ owl:intersectionOf [ rdf:first :chemical_entity ;
                                                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                                                    owl:onProperty :has_role ;
                                                                    owl:someValuesFrom :environmental_contaminant ] ;
                                                            rdf:rest :nil ] ] ] ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "Contaminated air is air which has sufficient concentrations of environmental pollutants such that it may adversely affect a given ecosystem." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:earthquake rdfs:subClassOf :material_transport_process ;
    :has_definition "An earthquake is a process during which energy is released in an astronomical body's crust, causing the displacement of crustal parts and the generation of seismic waves." ;
    :has_exact_synonym "quake" ;
    :has_related_synonym "temblor",
        "tremor" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:tectonic_earthquake rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom :active_geological_fault ],
        [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :structural_collapse_process ],
        [ a owl:Restriction ;
            owl:onProperty :causally_downstream_of_or_within ;
            owl:someValuesFrom :tectonic_movement ],
        :earthquake ;
    :has_definition "An earthquake caused by the sudden release of energy accumulated in an astronomical body's crust, as the elastic strain placed on constituent rock masses causes them to fracture." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:megathrust_earthquake rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom :convergent_plate_boundary ],
        :tectonic_earthquake ;
    :has_definition "A megathrust earthquake is a tectonic earthquake which occurs at subduction zones at destructive plate boundaries (convergent boundaries). These interplate earthquakes are the planet's most powerful, with moment magnitudes that can exceed 9.0." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:polluted_lake rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :contaminated_water ],
        :lake ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :lake ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :composed_primarily_of ;
                                    owl:someValuesFrom :contaminated_water ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A lake which has concentrations of environmental contaminants high enough to harm the ecosystems associated with it." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:sodium_chloride_salt rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :sodium_chloride ],
        :salt_material ;
    :has_broad_synonym "salt" ;
    :has_definition "A mineral material composed primarily of sodium chloride." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:glacial_abrasion rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom :rock ],
        :glacial_erosion_process ;
    :has_broad_synonym "abrasion",
        "scouring" ;
    :has_definition "A glacial abrasion process is an erosional process during which debris in the basal ice scrapes along the bed, polishing and gouging the underlying rocks, similar to sandpaper on wood." ;
    :has_exact_synonym "glacial scouring" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:glacial_plucking rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom :rock ],
        :glacial_erosion_process ;
    :has_broad_synonym "quarrying" ;
    :has_definition "Glacial plucking is an erosional process during which pieces of bedrock are cracked off due to the mechanical force of a moving glacier." ;
    :has_exact_synonym "glacial quarrying" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:glacial_ice_thrusting rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom :sediment ],
        :glacial_erosion_process ;
    :has_definition "Glacial ice thrusting is an erosional process during which a moving glacier which has frozen to its bed surges forward and moves large sheets of sediment frozen to the glacial mass." ;
    :has_exact_synonym "ice thrusting" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:water_mass rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :liquid_water ],
        :body_of_liquid ;
    :has_definition "A mass of water." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:marine_water_mass rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :sea_water ],
        :water_mass ;
    :has_definition "A mass of marine water." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:coast rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :overlaps ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :ocean ;
                            rdf:rest [ rdf:first :sea ;
                                    rdf:rest [ rdf:first :lake ;
                                            rdf:rest :nil ] ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :overlaps ;
            owl:someValuesFrom :planetary_landmass ],
        :compound_astronomical_body_part ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :compound_astronomical_body_part ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :overlaps ;
                                    owl:someValuesFrom :planetary_landmass ] ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :overlaps ;
                                            owl:someValuesFrom [ owl:unionOf [ rdf:first :ocean ;
                                                            rdf:rest [ rdf:first :sea ;
                                                                    rdf:rest [ rdf:first :lake ;
                                                                            rdf:rest :nil ] ] ] ] ] ;
                                    rdf:rest :nil ] ] ] ] ;
    :has_definition "A coast is the area where land meets the sea, ocean, or lake." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lake_coast rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :overlaps ;
            owl:someValuesFrom :lake ],
        :coast ;
    :has_definition "The general region of indefinite width that extends from a lake inland to the first major change in terrain features." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:tsunami rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :ocean ;
                            rdf:rest [ rdf:first :sea ;
                                    rdf:rest [ rdf:first :lake ;
                                            rdf:rest :nil ] ] ] ] ],
        :mass_liquid_flow ;
    :has_definition "A tsunami is a process during which a series of waves is generated in a water body, typically an ocean or large lake, by the displacement of a large volume of water. Earthquakes, volcanic eruptions and other underwater explosions (including detonations of underwater nuclear devices), landslides, glacier calvings, meteorite impacts and other disturbances above or below water all have the potential to generate a tsunami." ;
    :has_exact_synonym "seismic sea wave",
        "tidal wave" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mass_wasting rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :material_accumulation_process ],
        [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :environmental_material ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_quality ;
                                            owl:someValuesFrom :quality_of_a_solid ] ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :material_decumulation_process ],
        [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom :slope ],
        :material_transport_process ;
    :has_broad_synonym "mass movement" ;
    :has_definition "Mass wasting is the geomorphic process by which solid environmental material such as soil, sand, regolith, and/or rock move downslope typically as a mass, largely under the force of gravity, but frequently affected by water and water content as in submarine environments and mudslides." ;
    :has_exact_synonym "slope movement" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:avalanche rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :environmental_material ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :composed_primarily_of ;
                                            owl:someValuesFrom :snow ] ;
                                    rdf:rest :nil ] ] ] ],
        :mass_wasting_flow ;
    :has_definition "A mass wasting flow during which snow rapidly flows down a sloping surface." ;
    :has_exact_synonym "snowslide",
        "snowslip" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:landslide_process rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :scree ;
                            rdf:rest [ rdf:first :rock ;
                                    rdf:rest [ rdf:first :soil ;
                                            rdf:rest [ rdf:first :sediment ;
                                                    rdf:rest [ rdf:first :mud ;
                                                            rdf:rest [ rdf:first :sand ;
                                                                    rdf:rest :nil ] ] ] ] ] ] ] ],
        :mass_wasting ;
    :has_definition "A landslide is a process whereby a large mass of earth and rocks moves down a hill or a mountainside." ;
    :has_exact_synonym "landslip" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:geological_subsidence rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :submerged_bed ;
                            rdf:rest [ rdf:first :planetary_landmass ;
                                    rdf:rest :nil ] ] ] ],
        :material_transport_process ;
    :has_broad_synonym "subsidence" ;
    :has_definition "A material transport process during which a geological surface shifts downward relative to a datum such as sea-level." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mudslide rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :environmental_material ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :composed_primarily_of ;
                                            owl:someValuesFrom :mud ] ;
                                    rdf:rest :nil ] ] ] ],
        :mass_wasting .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mass_wasting_flow rdfs:subClassOf :mass_wasting ;
    :has_broad_synonym "flow" ;
    :has_definition "A mass wasting flow is a form of mass wasting during which the moving materials behave similarly to a flowing fluid. Water, air and ice are often involved in enabling fluidlike motion of the material." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mudflow rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :environmental_material ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_increased_levels_of ;
                                            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :liquid_water ;
                                                            rdf:rest [ rdf:first [ owl:unionOf [ rdf:first :clay ;
                                                                                    rdf:rest [ rdf:first :mud ;
                                                                                            rdf:rest :nil ] ] ] ;
                                                                    rdf:rest :nil ] ] ] ] ;
                                    rdf:rest :nil ] ] ] ],
        :mass_wasting_flow ;
    :has_definition "A mudflow is a form of mass wasting which involves very rapid to extremely rapid surging flow of debris that has become partially or fully liquified by the addition of significant amounts of water to clay-rich source material." ;
    :has_exact_synonym "mud flow" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:debris_flow rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom :soil ],
        [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom :stream_channel ],
        [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom :valley ],
        [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom :rock ],
        :mass_wasting_flow ;
    :has_definition "A mass wasting flow during which water-laden masses of soil and fragmented rock rush down the slopes of elevations, funnel into stream channels, entrain objects in their paths, and form thick, muddy deposits on valley floors." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lahar rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :environmental_material ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_increased_levels_of ;
                                            owl:someValuesFrom [ owl:unionOf [ rdf:first :volcanic_rock ;
                                                            rdf:rest [ rdf:first :tephra ;
                                                                    rdf:rest [ rdf:first :tuff ;
                                                                            rdf:rest [ rdf:first :volcanic_soil ;
                                                                                    rdf:rest :nil ] ] ] ] ] ] ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :volcano ;
                            rdf:rest [ rdf:first :volcanic_cone ;
                                    rdf:rest :nil ] ] ] ],
        :mudflow ;
    :has_definition "A lahar is a type of mudflow or debris flow composed of a slurry of pyroclastic material, rocky debris, and water. The material flows down from a volcano, typically along a river valley." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:sturzstrom rdfs:subClassOf :landslide_process ;
    :has_definition "A sturzstrom is a landslide consisting which has a great amount of kinetic energy resulting in greater horizontal movement when compared to its initial vertical drop — as much as 20 or 30 times the vertical distance. By contrast a normal landslide will typically travel a horizontal distance that is less than twice the distance that the material has fallen." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:volcanic_ash rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :silicon_dioxide ],
        [ a owl:Restriction ;
            owl:onProperty :output_of ;
            owl:someValuesFrom :volcanic_eruption ],
        :ash ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :ash ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :output_of ;
                                    owl:someValuesFrom :volcanic_eruption ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "Volcanic ash is an environmental material which consists of fragments of pulverized rock, minerals, and volcanic glass, created during volcanic eruptions and measuring less than 2 millimetres in diameter. Volcanic ash is formed during explosive volcanic eruptions, phreatomagmatic eruptions and during transport in pyroclastic density currents." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ash_fall_process rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom :planetary_surface ],
        [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom :volcanic_ash ],
        [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom :tephra ],
        [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :water_body ;
                            rdf:rest [ rdf:first :atmosphere ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :preceded_by ;
            owl:someValuesFrom [ a owl:Restriction ;
                    owl:onProperty :part_of ;
                    owl:someValuesFrom :volcanic_eruption ] ],
        :precipitation_process ;
    :has_definition "An ash fall process is a process in which volcanic ash formed during an explosive volcanic eruption, phreatomagmatic eruption, or during material transport in pyroclastic density currents is pulled towards the planetary surface by gravity." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hydrological_precipitation_process rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_input ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first [ owl:intersectionOf [ rdf:first :environmental_material ;
                                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                                            owl:onProperty :composed_primarily_of ;
                                                            owl:someValuesFrom :water ] ;
                                                    rdf:rest :nil ] ] ] ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :output_of ;
                                            owl:someValuesFrom :hydrological_condensation_process ] ;
                                    rdf:rest :nil ] ] ] ],
        :precipitation_process ;
    :has_broad_synonym "precipitation" ;
    :has_definition "Hydrological precipitation is a process during which any product of the condensation of atmospheric water vapour is pulled to the planetary surface by gravity." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hydrological_evaporation rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_input ;
            owl:someValuesFrom :liquid_water ],
        :evaporation,
        :hydrological_process ;
    :has_definition "Hydrological evaporation is the evaporation of water, generally as part of a planetary water cycle." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:soil_degradation rdfs:subClassOf :land_degradation ;
    :has_definition "Soil degradation is a process which results in a change in soil health status resulting in a diminished capacity of the ecosystem in which the soil occurs to provide goods and services for its  beneficiaries." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:soil_erosion rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom :soil ],
        :planetary_erosion ;
    :has_definition "Soil erosion is a process in which exogenic processes remove soil from one location on the Earth's crust and transport it to another location where it is deposited." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:coastal_flooding rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :lake ;
                            rdf:rest [ rdf:first :marine_water_body ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom :coast ],
        [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :ocean ;
                            rdf:rest [ rdf:first :sea ;
                                    rdf:rest [ rdf:first :lake ;
                                            rdf:rest :nil ] ] ] ] ],
        :flooding ;
    :has_definition "Coastal flooding is a process in which normally dry, low-lying land near a coast is flooded by sea water." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:riverine_flooding rdfs:subClassOf :flooding ;
    :has_definition "Riverine flooding is a process in which the flow rate of river water exceeds the capacity of its channel, thus flooding neighbouring land. Bends and meanders in a river channel are particularly disposed to such flooding." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:flash_flooding rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom :depressed_landform ],
        :flooding ;
    :has_definition "Flash flooding is a process in which low-lying land is inundated with water for a short period of time and are usually the result of precipitation or a breach in the container of a water body." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:flood rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :formed_as_result_of ;
            owl:someValuesFrom :flooding ],
        :water_body ;
    :has_definition "An unusual accumulation of water above the ground caused by high tide, heavy rain, melting snow or rapid runoff from paved areas." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:coastal_flood rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :overlaps ;
            owl:someValuesFrom :coast ],
        [ a owl:Restriction ;
            owl:onProperty :formed_as_result_of ;
            owl:someValuesFrom :coastal_flooding ],
        :flood ;
    :has_definition "A coastal flood is a flood which is formed as a result of large amounts of water from marine water bodies or large lakes being transported to usually dry land by displacement processes such as high winds or seismic activity." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:riverine_flood rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :formed_as_result_of ;
            owl:someValuesFrom :riverine_flooding ],
        [ a owl:Restriction ;
            owl:onProperty :continuous_with ;
            owl:someValuesFrom :river ],
        :flood ;
    :has_definition "A riverine flood is a flood which is formed as a result of a river's flow rate exceeding the capacity of its channel." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:flash_flood rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :formed_as_result_of ;
            owl:someValuesFrom :flash_flooding ],
        :flood ;
    :has_definition "A flash flood is a flood formed by the rapid flooding of geomorphic low-lying areas. It may be caused by heavy rain associated with a severe thunderstorm, hurricane, tropical storm, or meltwater from ice or snow flowing over ice sheets or snowfields. Flash floods may also occur after the collapse of a natural ice or debris dam, or a human structure such as a man-made dam. Flash floods are distinguished from a regular flood by a timescale of less than six hours." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:storm_surge rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :formed_as_result_of ;
            owl:someValuesFrom :storm_surge_process ],
        :coastal_flood ;
    :has_definition "A storm surge is a coastal flood which is caused by low-pressure weather systems such as tropical cyclones and strong extratropical cyclones, the severity of which is affected by the shallowness and orientation of the water body relative to storm path, and the timing of tides." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:meteotsunami rdfs:subClassOf :tsunami ;
    :has_definition "A meteotsunami is a tsunami caused by atmospheric processes and differences in air pressure." ;
    :has_exact_synonym "rissaga" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:storm_surge_process rdfs:subClassOf :coastal_flooding ;
    :has_definition "A storm surge process is a coastal flooding process which is caused by low pressure weather systems such as tropical cyclones and strong extratropical cyclones, the severity of which is affected by the shallowness and orientation of the water body relative to storm path, and the timing of tides." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:areal_flooding rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :plain ;
                            rdf:rest [ rdf:first :depressed_landform ;
                                    rdf:rest :nil ] ] ] ],
        :flooding ;
    :has_definition "Areal flooding is a flooding process in which flat or low-lying areas become inundated with water due to water input exceeding infiltration, evaporation, or run off." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:urban_flooding rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :city ;
                            rdf:rest [ rdf:first :dense_settlement_biome ;
                                    rdf:rest :nil ] ] ] ],
        :flooding ;
    :has_definition "Urban flooding is a flooding process in which land or property in a built environment, particularly in more densely populated areas, is inundated due to the rate of water input exceeding that of water drainage provided by the environment's drainage systems." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:snowmelt rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_output ;
            owl:someValuesFrom :fresh_water ],
        [ a owl:Restriction ;
            owl:onProperty :has_input ;
            owl:someValuesFrom :snow ],
        :hydrological_melting_process ;
    :has_definition "Snowmelt is a hydrological melting process in which water is produced by the melting of snow and becomes part of the hydrological surface runoff." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hydrological_melting_process rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_input ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :liquid_water ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_quality ;
                                            owl:someValuesFrom :quality_of_a_solid ] ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_output ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :liquid_water ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_quality ;
                                            owl:someValuesFrom :quality_of_a_liquid ] ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :thawing_process ],
        :hydrological_process,
        :melting ;
    :has_definition "A melting process during which water-based ice, snow, or other solid phase water transitions into a liquid phase." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:icemelt rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_input ;
            owl:someValuesFrom :water_ice ],
        [ a owl:Restriction ;
            owl:onProperty :has_output ;
            owl:someValuesFrom :fresh_water ],
        :hydrological_melting_process ;
    :has_definition "Icemelt is a hydrological melthing process in which water is produced by the melting of ice and becomes part of the hydrological surface runoff." ;
    :has_exact_synonym "ice melt" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:meltwater rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :formed_as_result_of ;
            owl:someValuesFrom :hydrological_melting_process ],
        :liquid_water ;
    :has_definition "Meltwater is the water released by the melting of snow or ice, including glacial ice, tabular icebergs and ice shelves over oceans." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:melting rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_output ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :environmental_material ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_quality ;
                                            owl:someValuesFrom :quality_of_a_liquid ] ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_input ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :environmental_material ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_quality ;
                                            owl:someValuesFrom :quality_of_a_solid ] ;
                                    rdf:rest :nil ] ] ] ],
        :material_transformation_process ;
    :has_definition "Melting is a material transformation process which results in the phase transition of a substance from a solid to a liquid." ;
    :has_exact_synonym "melting process" ;
    :has_related_synonym "fusion" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:condensation_process rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_input ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :environmental_material ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_quality ;
                                            owl:someValuesFrom :quality_of_a_gas ] ;
                                    rdf:rest :nil ] ] ] ],
        :material_congelation_process ;
    :has_definition "Condensation is a process during which a gas undergoes a phase transition into a liquid." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:chemical_precipitation_process rdfs:subClassOf :precipitation_process ;
    :has_definition "Chemical precipitation is a process in which a portion of some solid substance segregates from a material in which that substance or its precursors were dissolved in and settles due to a force such as gravity or centrifugal force. Segregation may occur due to the solubility limits of the precipitating substance being exceeded or due to a chemical reaction that forms a solid product from aqueous reagents." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:desublimation_process rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_output ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :environmental_material ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_quality ;
                                            owl:someValuesFrom :quality_of_a_solid ] ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_input ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :environmental_material ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_quality ;
                                            owl:someValuesFrom :quality_of_a_gas ] ;
                                    rdf:rest :nil ] ] ] ],
        :material_congelation_process ;
    :has_broad_synonym "deposition" ;
    :has_definition "Desublimation is a process in which a portion of some gas undergoes a phase transition into a portion of some solid." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:sublimation_process rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_input ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :environmental_material ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_quality ;
                                            owl:someValuesFrom :quality_of_a_solid ] ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_output ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :environmental_material ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_quality ;
                                            owl:someValuesFrom :quality_of_a_gas ] ;
                                    rdf:rest :nil ] ] ] ],
        :material_transformation_process ;
    :has_definition "Sublimation is a process during which a portion of some solid undergoes a phase transition into a portion of some gas." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:tectonic_uplift_process rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :submerged_bed ;
                            rdf:rest [ rdf:first :planetary_landmass ;
                                    rdf:rest :nil ] ] ] ],
        :tectonic_movement ;
    :has_definition "A tectonic uplift process is a geomorphologic process in which a geological surface shifts upward relative to a datum such as sea-level due to forces other than isostatic responses to unloading." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:atmospheric_subsidence rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :katabatic_wind ],
        [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :air ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :part_of ;
                                            owl:someValuesFrom :atmosphere ] ;
                                    rdf:rest :nil ] ] ] ],
        :material_transport_process ;
    :has_definition "A material transport process during which a mass of air moves through an atmosphere towards a planetary surface." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lava_flow_process rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom :planetary_landmass ],
        [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom :lava ],
        :mass_liquid_flow ;
    :has_definition "A process in which a volume of lava emitted during an effusive eruption moves along a solid surface." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:igneous_extrusion rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :igneous_rock ],
        :volcanic_feature ;
    :has_definition "A mass of igneous rock formed when hot magma flows out (extrudes) onto a planetary surface as lava or explodes violently into the atmosphere to fall back as pyroclastics or tuff." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:clastic_dike rdfs:subClassOf :dike,
        :sedimentary_intrusion ;
    :has_definition "A dike formed when sediment fills a pre-existing fracture in a mass of rock." ;
    :has_exact_synonym "clastic dyke" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:stock rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :formed_as_result_of ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :igneous_intrusion_process ;
                            rdf:rest [ rdf:first :planetary_erosion ;
                                    rdf:rest :nil ] ] ] ],
        :igneous_intrusion ;
    :has_definition "A stock is a discordant igneous intrusion having a surface exposure of less than 100 square kilometres. Stocks differ from batholiths only in being smaller." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:laccolith rdfs:subClassOf :rock_intrusion ;
    :has_definition "A sheet intrusion (or concordant pluton) that has been injected between two layers of sedimentary rock. The pressure of the magma is high enough that the overlying strata are forced upward, giving the laccolith a dome or mushroom-like form with a generally planar base." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lopolith rdfs:subClassOf :rock_intrusion ;
    :has_definition "A large igneous intrusion which is lenticular in shape with a depressed central region." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:phacolith rdfs:subClassOf :rock_intrusion ;
    :has_definition "A phacolith is an intrusion parallel to the bedding plane or foliation of folded country rock. More specifically, it is a typically lens-shaped intrusion that occupies either the crest of an anticline or the trough of a syncline." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:sill rdfs:subClassOf :rock_intrusion ;
    :has_definition "A tabular sheet intrusion that has intruded between older layers of sedimentary rock, beds of volcanic lava or tuff, or along the direction of foliation in metamorphic rock." ;
    :has_exact_synonym "concordant intrusive sheet" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:rock_precursor_intrusion_process rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom :rock ],
        [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :sediment ;
                            rdf:rest [ rdf:first :lava ;
                                    rdf:rest [ rdf:first :magma ;
                                            rdf:rest :nil ] ] ] ] ],
        :material_transport_process ;
    :has_definition "A process whereby the precursors of rock, such as magma or sedimentary particles, fill a fracture in a mass of rock." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:habitat rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :determined_by ;
            owl:someValuesFrom :population_of_organisms ],
        [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :biosphere ],
        :ecosystem ;
    :has_definition "An environmental system which can sustain and allow the growth of an ecological population."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:area_of_perennial_water_ice rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :atmospheric_boundary_layer ],
        [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :planetary_surface ],
        [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :area_of_perennial_ice_or_snow ],
        :environmental_zone ;
    :has_definition "An area of a planet's surface which is primarily composed of water ice, present throughout multiple years, in contact with an atmospheric column extending from the planetary boundary layer to the planet's exosphere with little to no physical obstruction." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:recycling_process rdfs:subClassOf :environmental_system_process ;
    :has_definition "A process during which materials deemed as waste are separated and converted into a form which can be used as input by the same processes which generated them."@en ;
    :has_exact_synonym "Recycling-Prozess"@de,
        "proceso de reciclaje"@es,
        "processo di riciclo"@it,
        "資源回收"@zh .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:carbon_bearing_gas_emission_process rdfs:subClassOf [ owl:intersectionOf [ rdf:first [ a owl:Restriction ;
                            owl:onProperty :has_quality ;
                            owl:someValuesFrom :quality_of_a_gas ] ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_output ;
                                    owl:someValuesFrom [ a owl:Restriction ;
                                            owl:onProperty :has_part ;
                                            owl:someValuesFrom :carbon_atom ] ] ;
                            rdf:rest :nil ] ] ],
        :hydrocarbon_gas_emission_process ;
    :has_broad_synonym "carbon emission process" ;
    :has_definition "A carbon emission process is any environmental process which outputs a carbon-bearing gas." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:land_consumption_process rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom :planetary_landmass ],
        [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :land_conversion_process ;
                            rdf:rest [ rdf:first :land_degradation ;
                                    rdf:rest :nil ] ] ] ],
        :anthropisation ;
    :has_definition "A process in which natural ecosystems present over an expanse of land are removed and replaced with anthropogenic ecosystems." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:human_dwelling rdfs:subClassOf :domestic_building ;
    :has_definition "A self-contained constructed feature used by one or more households as a home, such as a house, apartment, mobile home, houseboat or other 'substantial' structure. A dwelling typically includes nearby outbuildings, sheds etc. within the curtilage of the property, excluding any 'open fields beyond'. It has significance in relation to search and seizure, conveyancing of real property, burglary, trespass, and land use planning." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:area_of_perennial_snow rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :planetary_surface ],
        [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :atmospheric_boundary_layer ],
        [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :area_of_perennial_ice_or_snow ],
        :environmental_zone ;
    :has_definition "An area of a planet's surface which is primarily composed of snow, present throughout multiple years, in contact with an atmospheric column extending from the planetary boundary layer to the planet's exosphere with little to no physical obstruction." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:area_of_perennial_ice_or_snow rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :atmospheric_boundary_layer ],
        [ a owl:Restriction ;
            owl:onProperty :overlaps ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :snow ;
                            rdf:rest [ rdf:first [ owl:intersectionOf [ rdf:first :planetary_surface ;
                                                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                                                    owl:onProperty :composed_primarily_of ;
                                                                    owl:someValuesFrom :ice ] ;
                                                            rdf:rest :nil ] ] ] ;
                                    rdf:rest :nil ] ] ] ],
        :environmental_zone ;
    :alternative_term "perennial ice/snow" ;
    :has_definition "An area of a planet's surface which is primarily composed of snow or water ice, present throughout multiple years, in contact with an atmospheric column extending from the planetary boundary layer to the planet's exosphere with little to no physical obstruction." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:regolith rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :broken ],
        [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :piece_of_rock ;
                            rdf:rest [ rdf:first :soil ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :dust ],
        [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :planetary_crust ],
        :solid_layer ;
    :has_definition "A layer of loose, heterogeneous, superficial material covering solid rock. It includes dust, soil, broken rock, and other related materials." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:continental_crust rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :planetary_crust ],
        :planetary_structural_layer ;
    :has_definition "A layer of igneous, sedimentary, and metamorphic rocks that forms continents and the areas of shallow seabed close to their shores, known as continental shelves." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:oceanic_crust rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :planetary_crust ],
        :planetary_structural_layer ;
    :has_definition "Oceanic crust is the uppermost layer of the oceanic portion of a tectonic plate." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mohorovicic_discontinuity rdfs:subClassOf :planetary_structural_layer ;
    :has_definition "The Mohorovicic discontinuity, usually referred to as the Moho, is the boundary between the Earth's crust and the mantle, indicating a change in composition." ;
    :has_exact_synonym "Moho",
        "Mohorovičić discontinuity" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bedrock rdfs:subClassOf :rock ;
    :has_definition "A lithified mass of rock that lies under the loose softer material (regolith) at the surface of the Earth or other terrestrial planet." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:area_of_barren_land rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :atmospheric_boundary_layer ],
        :terrestrial_environmental_zone ;
    :alternative_term "Barren Land (Rock/Sand/Clay)" ;
    :has_definition "An area of a planet's surface which is primarily composed of bedrock, desert pavement, scarp rock, talus, material exposed by slides, volcanic material, glacial debris, sand, material exposed during strip mining, gravel, and other accumulations of earthen material in contact with an atmospheric column extending from the planetary boundary layer to the planet's exosphere with little to no physical obstruction." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:fumarole_derived_ice_tower rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :ice_cave ],
        [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :water_ice ],
        :cryoform,
        :elevated_landform,
        :surface_landform ;
    :has_definition "A hollow tower of ice formed by the freezing of steam escaping a fumarole." ;
    :has_related_synonym "ice chimney",
        "ice tower" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:aeroform rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :located_in ;
            owl:someValuesFrom :atmosphere ],
        [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :air ;
                            rdf:rest [ rdf:first :aerosol ;
                                    rdf:rest :nil ] ] ] ],
        :gaseous_astronomical_body_part ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :gaseous_astronomical_body_part ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :located_in ;
                                    owl:someValuesFrom :atmosphere ] ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :composed_primarily_of ;
                                            owl:someValuesFrom [ owl:unionOf [ rdf:first :air ;
                                                            rdf:rest [ rdf:first :aerosol ;
                                                                    rdf:rest :nil ] ] ] ] ;
                                    rdf:rest :nil ] ] ] ] ;
    :has_definition "A part of an astronomical body which is primarily composed of a continuous volume of gaseous or aerosolised material held in shape by one or more environmental processes." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cloud rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :aerosolised_liquids ;
                            rdf:rest [ rdf:first :aerosolised_solids ;
                                    rdf:rest [ rdf:first [ owl:intersectionOf [ rdf:first :crystal ;
                                                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                                                            owl:onProperty :has_quality ;
                                                                            owl:someValuesFrom :frozen ] ;
                                                                    rdf:rest :nil ] ] ] ;
                                            rdf:rest :nil ] ] ] ] ],
        :meteor ;
    :has_definition "A cloud is a visible mass of aerosolised liquid droplets or frozen crystals suspended in an atmosphere above the surface of a planetary body." ;
    :has_exact_synonym "cloud mass" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:polar_stratospheric_cloud rdfs:subClassOf :water_based_cloud ;
    :has_definition "Polar stratospheric clouds are clouds which form in the winter polar stratosphere at altitudes of 15,000–25,000 metres and which support chemical reactions that produce active chlorine and remove gaseous nitric acid, catalysing ozone destruction." ;
    :has_exact_synonym "nacreous cloud" ;
    :has_related_synonym "PSC" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:sparsely_populated_settlement rdfs:subClassOf :populated_place ;
    :has_definition "A settlement with a low density of buildings and inhabitants." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:rural_settlement rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :rural_area ],
        :anthropised_terrestrial_environmental_zone,
        :sparsely_populated_settlement ;
    :has_definition "A settlement which has lower population density than a town, city, or other urban environment and is primarily used for agricultural or pastoral activity." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:formal_settlement rdfs:subClassOf :populated_place ;
    :has_definition "A settlement which has been established and is managed through officially sanctioned processes and is recognised as legal by a competent authority." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:informal_settlement rdfs:subClassOf :populated_place ;
    :has_definition "A settlement which is not associated with or directed by official planning processes and which typically lacks municipal services and infrastructure such as sanitation, water services, and waste management services." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:legal_settlement rdfs:subClassOf :populated_place ;
    :has_definition "A settlement on land that the inhabitants have a legal claim to." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:illegal_settlement rdfs:subClassOf :populated_place ;
    :has_definition "A settlement on land that the inhabitants have no legal claim to or occupy illegally." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:primary_forest rdfs:subClassOf :forest_ecosystem ;
    :has_definition "Forest which originally covered a region before changes in the environment brought about by people. (Source: PHC)" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:carbon_dioxide_emission_process rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_output ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :carbon_dioxide ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_quality ;
                                            owl:someValuesFrom :quality_of_a_gas ] ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :causally_upstream_of_or_within ;
            owl:someValuesFrom :greenhouse_effect ],
        :carbon_bearing_gas_emission_process ;
    :has_definition "A carbon emission process is any environmental process which releases carbon dioxide gas into the atmosphere." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:carbon_dioxide_emission rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :output_of ;
            owl:someValuesFrom :carbon_dioxide_emission_process ],
        :atmospheric_carbon_dioxide ;
    :has_definition "A volume of carbon dioxide gas emitted by a carbon dioxide emission process." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:all_season_road rdfs:subClassOf :road ;
    :has_definition "A road which is usable across all seasons." ;
    :has_exact_synonym "all-season road" ;
    :has_related_synonym "permanent road" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:rural_area rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :overlaps ;
            owl:someValuesFrom :vegetated_area ],
        :anthropised_terrestrial_environmental_zone ;
    :has_definition "An area which is outside of a town, city, or urban area. Rural areas are primarily used for agriculture or pastoralism and may contain rural settlements." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:village rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :village_biome ],
        :populated_place ;
    :has_definition "A village is a clustered human settlement or community, larger than a hamlet but smaller than a town, with a population ranging from a few hundred to a few thousand. Though often located in rural areas, the term urban village is also applied to certain urban neighbourhoods. Villages are normally permanent, with fixed dwellings; however, transient villages can occur. Further, the dwellings of a village are fairly close to one another, not scattered broadly over the landscape, as a dispersed settlement." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:oligotrophic_lake rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :oligotrophic_water ],
        :lake ;
    :has_definition "A lake which has nutrient-poor water." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mesotrophic_lake rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :mesotrophic_water ],
        :lake ;
    :has_definition "A lake with medium nutrient levels, which allow moderate productivity." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:piece_of_plastic rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :synthetic_plastic ],
        :mass_of_solid_material ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :mass_of_solid_material ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :composed_primarily_of ;
                                    owl:someValuesFrom :synthetic_plastic ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A mass of solid material which is primarily composed of plastic."@en ;
    :has_exact_synonym "Plastikstück"@de,
        "pedazo de plástico"@es,
        "pezzo di plastica"@it .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:nurdle rdfs:subClassOf :plastic_pellet ;
    :has_definition "A plastic pellet which is produced such that its size allows it to be rapidly melted and used as input for further downstream manufacturing processes."@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:key_biodiversity_area rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :overlaps ;
            owl:someValuesFrom :ecosystem ],
        :area_of_protected_biodiversity ;
    :alternative_term "important site" ;
    :has_definition "An environmental zone which contains, as determined by an officially mandated selection process, one or more ecosystems which include, as parts, ecological communities of global significance for conservation due to their vulnerability and irreplaceability." ;
    :has_narrow_synonym "Alliance for Zero Extinction Sites",
        "Ecologically and Biologically Significant Area",
        "IUCN Important Site for Freshwater Biodiversity",
        "Important Bird Area",
        "Important Mammal Area",
        "Important Plant Area",
        "Important Site for Freshwater Biodiversity",
        "Prime Butterfly Area",
        "Ramsar Sites" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:public_infrastructure rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :participates_in ;
            owl:someValuesFrom :usage_of_an_environment_for_infrastructure_and_utilities ],
        :human_construction ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :human_construction ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :participates_in ;
                                    owl:someValuesFrom :usage_of_an_environment_for_infrastructure_and_utilities ] ;
                            rdf:rest :nil ] ] ] ;
    :has_broad_synonym "infrastructure" ;
    :has_definition "The system of public works in a country, state or region, including roads, utility lines and public buildings." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:public_road rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :public_infrastructure ],
        :road ;
    :has_definition "A road which is publically accessible." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:public_building rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :public_infrastructure ],
        :building ;
    :has_definition "A building which is publically accessible." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:utility_line rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :public_infrastructure ],
        [ a owl:Restriction ;
            owl:onProperty :participates_in ;
            owl:someValuesFrom :usage_of_an_environment_for_infrastructure_and_utilities ],
        :manufactured_product ;
    :has_definition "A cable used to trasmit electricity from its point of production to its point of consumption." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:public_utility_line rdfs:subClassOf :utility_line ;
    :has_definition "A utility line which services the public power grid." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:illegal_informal_settlement rdfs:subClassOf :informal_settlement ;
    :has_broad_synonym "informal settlement" ;
    :has_definition "A populated place where groups of housing units have been constructed on land that the occupants have no legal claim to, or occupy illegally, or where dwellings are not in compliance with current planning and building regulations." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:material_extraction_process rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom :environmental_material ],
        [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :material_transport_process ],
        :environmental_system_process,
        :planned_process ;
    :has_definition "A planned process during which a portion of environmental material is removed from a material entity." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:fire rdfs:subClassOf :combustion_process ;
    :has_definition "A fire is a process whereby rapid and exothermic oxidation of a material through a combustion process releases heat, light, and other products." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:wildfire rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :occurs_in ;
            owl:someValuesFrom :terrestrial_biome ],
        [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :rural_area ;
                            rdf:rest [ rdf:first :vegetated_area ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_output ;
            owl:someValuesFrom :hydrocarbon_flame ],
        :conflagration ;
    :has_definition "A conflagration which is uncontrolled and combusts material in a vegetated area, be it rural or wild." ;
    :has_exact_synonym "wildland fire" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:conflagration rdfs:subClassOf :fire ;
    :has_definition "A fire which occurs in a large spatial area poses a risk to human life, animal life, health, and/or property." ;
    :has_related_synonym "blaze",
        "large fire" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:flame rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :increased_temperature ],
        :gaseous_environmental_material ;
    :has_definition "A portion of gas which is emitted by a fire or other exothermic reaction, is of increased temperature, and typically emits light in the visible range." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hydrocarbon_flame rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :output_of ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :combustion_process ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_input ;
                                            owl:someValuesFrom :hydrocarbon_based_environmental_material ] ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :dioxygen ;
                            rdf:rest [ rdf:first :carbon_dioxide ;
                                    rdf:rest [ rdf:first :dinitrogen ;
                                            rdf:rest [ rdf:first :water_vapour ;
                                                    rdf:rest :nil ] ] ] ] ] ],
        :flame ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :flame ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :output_of ;
                                    owl:someValuesFrom [ owl:intersectionOf [ rdf:first :combustion_process ;
                                                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                                                    owl:onProperty :has_input ;
                                                                    owl:someValuesFrom :hydrocarbon_based_environmental_material ] ;
                                                            rdf:rest :nil ] ] ] ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A flame which is produced by the combustion of hydrocarbon fuel." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:forest_fire rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_input ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :viridiplantae ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :part_of ;
                                            owl:someValuesFrom :forest_ecosystem ] ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :occurs_in ;
            owl:someValuesFrom :forested_area ],
        [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom :forest_ecosystem ],
        :land_fire ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :land_fire ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :occurs_in ;
                                    owl:someValuesFrom [ owl:unionOf [ rdf:first :forested_area ;
                                                    rdf:rest [ rdf:first :forest_biome ;
                                                            rdf:rest [ rdf:first :forest_ecosystem ;
                                                                    rdf:rest :nil ] ] ] ] ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A wildfire which occurs in a forest, primarily consuming vegetation as fuel." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mass_gaseous_flow rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom :gaseous_environmental_material ],
        :mass_fluid_flow ;
    :has_definition "A process whereby a large volume of gas moves due to a disequilibrium of physical forces." ;
    :has_related_synonym "wind" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:atmospheric_wind rdfs:subClassOf :atmospheric_process,
        :mass_gaseous_flow ;
    :has_broad_synonym "wind" ;
    :has_related_synonym "A mass gaseous flow which occurrs in a planet's atmosphere due to internal pressure disequilibria." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:stellar_wind rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :stellar_radiation ],
        [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom :star ],
        :mass_plasma_flow ;
    :has_definition "A stream of plasma primarily composed of electrons, protons, and alpha particles ejected from the upper atmosphere of a star." ;
    :has_related_synonym "Solar wind" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:planetary_wind rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom [ a owl:Restriction ;
                    owl:onProperty :composed_primarily_of ;
                    owl:someValuesFrom [ owl:intersectionOf [ rdf:first :gaseous_environmental_material ;
                                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                                    owl:onProperty :input_of ;
                                                    owl:someValuesFrom :atmospheric_escape ] ;
                                            rdf:rest :nil ] ] ] ] ],
        :mass_gaseous_flow ;
    :has_related_synonym "A mass gaseous flow in which planetary atmospheric gases flow into outer space.",
        "atmospheric escape" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mass_plasma_flow rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom :plasma ],
        :mass_fluid_flow ;
    :has_definition "A process whereby a large volume of plasma moves due to a disequilibrium of physical forces." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:gaseous_environmental_material rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :quality_of_a_gas ],
        :fluid_environmental_material ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :environmental_material ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_quality ;
                                    owl:someValuesFrom :quality_of_a_gas ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A material entity which is composed of one or more chemical entities and has neither independent shape nor volume but tends to expand indefinitely." ;
    :has_narrow_synonym "gas" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:plasma rdfs:subClassOf :fluid_environmental_material ;
    :has_definition "A material entity which is composed of a volume of unbound positive and negative particles in roughly equal numbers, conducts electricity, and possesses internal magnetic fields." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:astronomical_body rdfs:subClassOf :astronomical_object ;
    :has_definition "An object which is naturally occuring, bound together by gravitational or electromagnetic forces, and surrounded by space." ;
    :has_related_synonym "celestial body" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:planet rdfs:subClassOf :astronomical_body ;
    :has_definition "A planet is an astronomical body orbiting a star or stellar remnant that is massive enough to be rounded by its own gravity, is not massive enough to cause thermonuclear fusion, and has cleared its neighbouring region of planetesimals." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:star rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :plasma ],
        :astronomical_body,
        :mass_of_environmental_material ;
    :has_definition "An astronomical object which is composed primarily of luminous plasma held in a spherical form by gravitational forces." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:planetary_moon rdfs:subClassOf :astronomical_body ;
    :has_broad_synonym "moon" ;
    :has_definition "An astronomical body which orbits a planet of comparatively greater mass." ;
    :has_related_synonym "natural satellite" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:astronomical_object rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :astronomical_body ],
        [ a owl:Restriction ;
            owl:onProperty :surrounded_by ;
            owl:someValuesFrom :outer_space ],
        [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :geodiversity ],
        :object ;
    :has_definition "An object which is composed of one or more gravitationally bound structures that are associated with a position in space." ;
    :has_related_synonym "celestial object" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:globular_star_cluster rdfs:subClassOf :astronomical_object ;
    :has_definition "A group of gravitationally bound stars." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:nebula rdfs:subClassOf :astronomical_object ;
    :has_definition "An interstellar cloud of dust, hydrogen, helium and other ionized gases" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:galaxy rdfs:subClassOf :astronomical_object ;
    :has_definition "A galaxy is a gravitationally bound system of stars, stellar remnants, interstellar gas, dust, and dark matter." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:dwarf_planet rdfs:subClassOf :minor_planet ;
    :has_definition "An astronomical body which is in direct orbit of a star and is massive enough for its own gravity to compress it into a shape preserved by hydrostatic equilibrium (usually a spheroid), but which shares its orbit with other bodies, such as asteroids or comets." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:minor_planet rdfs:subClassOf :astronomical_body ;
    :has_definition "A minor planet is an astronomical object in direct orbit around the Sun that is neither a planet nor exclusively classified as a comet. Minor planets can be dwarf planets, asteroids, trojans, centaurs, Kuiper belt objects, and other trans-Neptunian objects." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:planetary_atmosphere rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :partially_surrounded_by ;
            owl:someValuesFrom :planetary_surface ],
        :atmosphere ;
    :has_definition "An atmosphere which surrounds a planet." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:nitrogen_oxygen_planetary_atmosphere rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :dioxygen ;
                            rdf:rest [ rdf:first :dinitrogen ;
                                    rdf:rest :nil ] ] ] ],
        :planetary_atmosphere ;
    :has_definition "A planetary atmosphere which is composted primarily of dinitrogen and dioxygen gas." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:desert_pavement rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :desert ],
        [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :pebble ;
                            rdf:rest [ rdf:first :cobble ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :rock ],
        :solid_surface_layer,
        :surface_of_an_astronomical_body ;
    :has_definition "A desert surface covered with closely packed, interlocking angular or rounded rock fragments of pebble and cobble size." ;
    :has_exact_synonym "gibber",
        "reg",
        "saï",
        "serir" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:astronomical_body_part rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :astronomical_body ],
        :fiat_object_part ;
    :has_definition "A material part of an astronomical body." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:solid_environmental_material rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :quality_of_a_solid ],
        :environmental_material ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :environmental_material ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_quality ;
                                    owl:someValuesFrom :quality_of_a_solid ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An environmental material which is in a solid state." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:liquid_environmental_material rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :quality_of_a_liquid ],
        :fluid_environmental_material ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :environmental_material ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_quality ;
                                    owl:someValuesFrom :quality_of_a_liquid ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An environmental material which is in a liquid state." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:area_of_deciduous_forest rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :temperate_deciduous_broadleaf_forest ;
                            rdf:rest [ rdf:first :temperate_deciduous_needleleaf_forest ;
                                    rdf:rest [ rdf:first :tropical_deciduous_broadleaf_forest ;
                                            rdf:rest [ rdf:first :tropical_semi_deciduous_broadleaf_forest ;
                                                    rdf:rest :nil ] ] ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :atmospheric_boundary_layer ],
        :terrestrial_environmental_zone ;
    :alternative_term "deciduous forest" ;
    :has_definition "An area of a planet's surface which is primarily covered by a forest in which the majority of trees shed foliage simultaneously in response to seasonal change. The surfaces of this area (including the surface of the forest canopy) are in contact with an atmospheric column extending from the planetary boundary layer to the planet's exosphere with little to no physical obstruction." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:biosphere rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :collection_of_organisms ],
        :compound_astronomical_body_part ;
    :has_definition "A biosphere is a part of an astronomical body which includes, as parts, all the living entities within the gravitational sphere of influence of that body, as well as the non-living and dead entities with which they interact." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hydrosphere rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :liquid_water ],
        :liquid_astronomical_body_part ;
    :has_definition "An astronomical body part which is composed of the combined mass of water found on, under, and over the surface of a planet." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pedosphere rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :overlaps ;
            owl:someValuesFrom :lithosphere ],
        [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :soil ],
        [ a owl:Restriction ;
            owl:onProperty :overlaps ;
            owl:someValuesFrom :biosphere ],
        [ a owl:Restriction ;
            owl:onProperty :overlaps ;
            owl:someValuesFrom :hydrosphere ],
        [ a owl:Restriction ;
            owl:onProperty :overlaps ;
            owl:someValuesFrom :atmosphere ],
        :compound_astronomical_body_part ;
    :has_definition "An astronomical body part which is composed of soil, subject to soil formation processes, and found on the surface of a lithosphere." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:photosphere rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :star ],
        :astronomical_body_part ;
    :has_definition "An astronomical body part which is composed of those parts of a star, distal from the star's core, from which light is radiated into space." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:planetary_photic_zone rdfs:subClassOf :astronomical_body_part ;
    :has_definition "A planetary part which is exposed, at least periodically, to light." ;
    :has_related_synonym "photosphere" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:illuminated_biosphere_part rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :biosphere ],
        :astronomical_body_part ;
    :has_definition "An astronomical body part which includes those parts of a biosphere that are, at least periodically, illuminated and in which photosynthesis may occur." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:exorheic_lake rdfs:subClassOf :fresh_water_body,
        :lake ;
    :has_definition "A lake from which water constantly flows out of under almost all climatic circumstances, maintaining low concentrations of dissolved solid relative to endorheic lakes." ;
    :has_exact_synonym "open lake" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:eaves rdfs:subClassOf :building_part ;
    :has_definition "A part of a building roof which overhangs the face of a wall and, normally, projects beyond the side of a building." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:open_eaves rdfs:subClassOf :eaves ;
    :has_definition "Overhanging eaves where the rafters and underside of the roof are visible from below." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:closed_eaves rdfs:subClassOf :eaves ;
    :has_definition "Eaves in which projecting roof members are not visible, being closed from view by boarding." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:humid_air rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_increased_levels_of ;
            owl:someValuesFrom :water_vapour ],
        [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :increased_humidity ],
        :air ;
    :has_definition "Air which has increased levels of water vapour." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:water_vapour_saturated_air rdfs:subClassOf :humid_air ;
    :has_definition "Air which has a partial pressure of water vapour equal or near equal to its equilibrium vapor pressure at a given temperature." ;
    :has_exact_synonym "water-vapour-saturated air" ;
    :has_related_synonym "wet air" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:water_based_rainfall rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom :raindrop ],
        [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom :water_vapour_saturated_air ],
        :hydrological_precipitation_process ;
    :has_broad_synonym "rain fall",
        "rainfall" ;
    :has_definition "A hydrological precipitation process in which atmospheric water vapour condenses to form droplets of liquid water massive enough to fall to a planetary surface due to the planet's gravity." ;
    :has_related_synonym "rain" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:droplet rdfs:subClassOf :mass_of_liquid ;
    :has_definition "A droplet is a small column of liquid, bounded completely or almost completely by free surfaces which maintains its shape due to the surface tension of the liquid." ;
    :has_related_synonym "drop" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:raindrop rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :formed_as_result_of ;
            owl:someValuesFrom :condensation_process ],
        :droplet ;
    :has_definition "A droplet formed by condensation of vapour in an atmosphere and which is sufficiently massive to overcome atmospheric resistance and fall to a planetary surface due to gravity." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:water_droplet rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :liquid_water ],
        :droplet ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :droplet ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :composed_primarily_of ;
                                    owl:someValuesFrom :liquid_water ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A droplet of water" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:water_raindrop rdfs:subClassOf :raindrop,
        :water_droplet ;
    :has_broad_synonym "raindrop" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cloud_droplet rdfs:subClassOf :droplet ;
    :has_definition "A droplet which is spherical in shape and suspended in an atmosphere, being of too small a mass to be pulled to a planetary surface by gravity." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:water_based_cloud_droplet rdfs:subClassOf :cloud_droplet,
        :water_droplet ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :cloud_droplet ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :composed_primarily_of ;
                                    owl:someValuesFrom :liquid_water ] ;
                            rdf:rest :nil ] ] ] ;
    :has_broad_synonym "cloud drop",
        "cloud droplet" ;
    :has_definition "A cloud droplet composed primarily of water." ;
    :has_exact_synonym "water based cloud droplet" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:virga rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :sublimation_process ],
        :hydrological_precipitation_process ;
    :has_broad_synonym "A process in which precipitation falls from a cloud but evaporates or sublimes before making contact with a planetary surface." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:smoke rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :formed_as_result_of ;
            owl:someValuesFrom :combustion_process ],
        [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :gaseous_environmental_material ;
                            rdf:rest [ rdf:first :solid_environmental_material ;
                                    rdf:rest [ rdf:first :liquid_environmental_material ;
                                            rdf:rest :nil ] ] ] ] ],
        :aerosol .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:combustion_process rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_input ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :material_entity ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_quality ;
                                            owl:someValuesFrom :combustibility ] ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_output ;
            owl:someValuesFrom :smoke ],
        [ a owl:Restriction ;
            owl:onProperty :has_input ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :material_entity ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_role ;
                                            owl:someValuesFrom :fuel ] ;
                                    rdf:rest :nil ] ] ] ],
        :aerosol_formation_process,
        :thermolysis ;
    :has_definition "Combustion or burning is a high-temperature exothermic redox chemical reaction between a fuel and an oxidant that produces oxidized, often gaseous products, in a mixture termed as smoke." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:thermolysis rdfs:subClassOf :material_transformation_process ;
    :has_definition "A chemical decomposition (the separation of a single chemical compound into its two or more elemental parts or to simpler compounds) caused by heat." ;
    :has_exact_synonym "thermal decomposition" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pyrolysis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :occurs_in ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :environmental_material ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_quality ;
                                            owl:someValuesFrom :anaerobic ] ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom :organic_material ],
        [ a owl:Restriction ;
            owl:onProperty :has_output ;
            owl:someValuesFrom :smoke ],
        :aerosol_formation_process,
        :thermolysis ;
    :has_definition "A thermolysis process in which organic material is decomposed in the absence of oxygen." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:smog rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :environmental_material ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :derives_from ;
                                            owl:someValuesFrom :smoke ] ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :smoke ;
                            rdf:rest [ rdf:first :fog ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_role ;
            owl:someValuesFrom :environmental_contaminant ],
        :fog ;
    :has_definition "A fog which is intermixed with smoke or other combustion products and their derivatives." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:area_of_evergreen_forest rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :atmospheric_boundary_layer ],
        [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :tropical_marine_semi_evergreen_forest ;
                            rdf:rest [ rdf:first :temperate_evergreen_needleleaf_forest ;
                                    rdf:rest [ rdf:first :tropical_lowland_evergreen_broadleaf_rain_forest ;
                                            rdf:rest [ rdf:first :tropical_semi_evergreen_moist_broadleaf_forest ;
                                                    rdf:rest [ rdf:first :temperate_broadleaf_evergreen_forest ;
                                                            rdf:rest :nil ] ] ] ] ] ] ],
        :vegetated_area ;
    :alternative_term "evergreen forest" ;
    :has_definition "An area of a planet's surface which is primarily covered by a forest in which the majority of trees maintain their foliage despite seasonal change. The surfaces of this area (including the surface of the forest canopy) are in contact with an atmospheric column extending from the planetary boundary layer to the planet's exosphere with little to no physical obstruction." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:fog rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :water_based_cloud_droplet ;
                            rdf:rest [ rdf:first :water_ice_crystal ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :located_in ;
            owl:someValuesFrom :atmosphere ],
        [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :liquid_water ],
        [ a owl:Restriction ;
            owl:onProperty :output_of ;
            owl:someValuesFrom :condensation_process ],
        :aerosolised_liquids,
        :atmospheric_aerosol ;
    :has_definition "A visible mass of cloud water droplets or ice crystals suspended in the air at or near the surface of an astronomical body." ;
    :has_related_synonym "haar" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:crystal rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :structured ],
        :solid_environmental_material ;
    :has_definition "A solid material whose constituents, such as atoms, molecules or ions, are arranged in a highly ordered microscopic structure, forming a crystal lattice that extends in all directions." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:water_ice_crystal rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :water_ice ],
        :crystal ;
    :has_broad_synonym "ice crystal" ;
    :has_definition "A crystal which is primarily composed of water ice." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hair_ice rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :located_in ;
            owl:someValuesFrom :broadleaf_forest_biome ],
        :water_ice ;
    :has_definition "A type of water ice that forms on dead wood with the assistance of the fungus Exidiopsis effusa and takes the shape of fine, silky hair." ;
    :has_exact_synonym "frost beard",
        "ice wool" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:flower_strip rdfs:subClassOf :vegetated_area ;
    :has_definition "A vegetated area which includes a community of flowering plants that provide food for local pollinators." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:flower_rich_field_margin_strip rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :agricultural_field ],
        :flower_strip ;
    :has_definition "A flower strip which is present at the margins of cultivated fields." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:clathrate_material rdfs:subClassOf :crystal ;
    :has_definition "A material which is primarily composed of a substance arranged as a lattice which can trap or contain other molecules." ;
    :has_exact_synonym "clathrate compound material",
        "clathrate crystal material" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:methane_clathrate rdfs:subClassOf :clathrate_material ;
    :has_definition "A clathrate material in which a large amount of methane is trapped within a crystal structure of water, forming a solid similar to ice." ;
    :has_exact_synonym "fire ice",
        "gas hydrate",
        "hydromethane",
        "methane hydrate",
        "methane ice",
        "natural gas hydrate" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:coral_bleaching_process rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom :coral_reef ],
        :ecosystem_process ;
    :has_definition "An environmental process in which coral expels the symbiotic algae living in its tissue as a result of stress, causing the coral to turn white." ;
    :has_related_synonym "coral bleaching" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:marl rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :calcium_carbonate ],
        [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :silt ],
        [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :clay ],
        :mineral_material ;
    :has_definition "Marl is a mass of calcium carbonate derived from mollusk shells and mixed with silt and clay." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:tropical_marine_coral_reef_biome rdfs:subClassOf :marine_coral_reef_biome,
        :tropical_biome ;
    :has_definition "A marine coral reef biome which is located in a region with a tropical climate." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:area_of_mixed_forest rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :atmospheric_boundary_layer ],
        [ a owl:Restriction ;
            owl:onProperty :overlaps ;
            owl:someValuesFrom :mixed_forest ],
        :vegetated_area ;
    :has_definition "An area of a planet's surface which is primarily covered by a forest in which the trees are a mixture between those that lose and retain their foliage despite seasonal change. The surfaces of this area (including the surface of the forest canopy) are in contact with an atmospheric column extending from the planetary boundary layer to the planet's exosphere with little to no physical obstruction." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:temperate_marginal_sea_biome rdfs:subClassOf :marginal_sea_biome,
        :temperate_biome ;
    :has_definition "A marginal sea biome which is located in a region with a temperate climate." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:temperate_mediterranean_sea_biome rdfs:subClassOf :mediterranean_sea_biome ;
    :has_definition "A mediterranean sea biome which is subject to temperate climate patterns."@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:marine_upwelling_biome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :environmental_system ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :determined_by ;
                                            owl:someValuesFrom :upwelling ] ;
                                    rdf:rest :nil ] ] ] ],
        :marine_biome ;
    :has_definition "A marine biome which contains communities adapted to living in an environment determined by an upwelling process." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:tropical_marine_upwelling_biome rdfs:subClassOf :marine_upwelling_biome,
        :tropical_biome ;
    :has_definition "A marine upwelling biome which is subject to tropical climate patterns." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:temperate_marine_upwelling_biome rdfs:subClassOf :marine_upwelling_biome,
        :temperate_biome ;
    :has_definition "A marine upwelling biome which is located in a region subject to temperate climate patterns." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:area_of_dwarf_scrub rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :scrubland_area ],
        [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :atmospheric_boundary_layer ],
        :bush_area ;
    :alternative_term "dwarf scrub" ;
    :has_definition "An area of a planet's surface which is partly covered by shrubs with ground-hugging stems or low growth habit, in contact with an atmospheric column extending from the planetary boundary layer to the planet's exosphere with little to no physical obstruction." ;
    :has_exact_synonym "area of subshrub" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:turbulent_aquatic_surface_layer rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :water_body ],
        :aquatic_layer,
        :liquid_air_water_interface_layer,
        :surface_of_an_astronomical_body ;
    :has_broad_synonym "overfall" ;
    :has_definition "A turbulent surface layer of a water body maintained by strong currents setting over submerged ridges or shoals or by winds opposing a current." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:overflow_structure rdfs:subClassOf :human_construction ;
    :has_broad_synonym "overfall" ;
    :has_definition "A structure which is built into the container of a water body which allows water to flow out of the container when the volume of the water contained exceeds that of its cavity." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mouth_of_liquid_discharge_conduit rdfs:subClassOf :mouth ;
    :has_broad_synonym "overfall" ;
    :has_definition "A site at the terminus of a liquid conveyance conduit where the liquid carried is discharged into the sea or a river." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:electric_power_system rdfs:subClassOf :manufactured_product ;
    :has_definition "An electric power system is a network of electrical components used to supply, transfer and use electric power." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:photovoltaic_system rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :solar_panel_array ],
        :electric_power_system ;
    :has_definition "A photovoltaic system is a power system designed to supply usable solar power by means of photovoltaics. It consists of an arrangement of several components, including solar panels to absorb and convert sunlight into electricity, a solar inverter to change the electric current from DC to AC, as well as mounting, cabling and other electrical accessories to set up a working system." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:solar_panel_array rdfs:subClassOf :manufactured_product ;
    :has_definition "A group of solar panels, typically belonging to the same photovoltaic system, arranged to maximise interception of solar radiation." ;
    :has_exact_synonym "photovoltaic panel array" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:domestic_solar_panel_array rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :human_dwelling ],
        :solar_panel_array ;
    :has_definition "A solar panel array that is integrated into the power system of a human dwelling." ;
    :has_exact_synonym "domestic photovoltaic panel array" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:area_of_scrub rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :atmospheric_boundary_layer ],
        [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :scrubland_area ],
        :bush_area ;
    :alternative_term "shrub/scrub" ;
    :has_definition "An area of a planet's surface which is primarily covered by a shrubs, young trees, or stunted trees.. The surfaces of this area are in contact with an atmospheric column extending from the planetary boundary layer to the planet's exosphere with little to no physical obstruction." ;
    :has_exact_synonym "area of shrub" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ground_deformation_process rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_output ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :planetary_landmass ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_quality ;
                                            owl:someValuesFrom :deformed ] ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_input ;
            owl:someValuesFrom :planetary_landmass ],
        :environmental_system_process ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :environmental_system_process ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_input ;
                                    owl:someValuesFrom :planetary_landmass ] ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_output ;
                                            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :planetary_landmass ;
                                                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                                                            owl:onProperty :has_quality ;
                                                                            owl:someValuesFrom :deformed ] ;
                                                                    rdf:rest :nil ] ] ] ] ;
                                    rdf:rest :nil ] ] ] ] ;
    :has_definition "A process in which a solid planetary surface is deformed." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:puddle_of_water rdfs:subClassOf :lentic_water_body ;
    :has_definition "A puddle is a small accumulation of water, on a surface. It can form either by pooling in a depression on the surface, or by surface tension upon a flat surface." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ballast_water rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :contained_in ;
            owl:someValuesFrom :ballast_tank ],
        :liquid_water ;
    :has_definition "Ballast water is water contained in the ballast tanks of sea-going vessels." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ballast_tank rdfs:subClassOf :manufactured_product ;
    :has_definition "A ballast tank is a compartment within a boat, ship or other floating structure that holds water, which is used as ballast to provide stability for a vessel." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hailfall rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom :hail_stone ],
        [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :object_aggregate ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_member ;
                                            owl:someValuesFrom :hail_stone ] ;
                                    rdf:rest :nil ] ] ] ],
        :hydrological_precipitation_process ;
    :has_definition "A hydrological process during which hail stones fall to the surface of an astronomical body." ;
    :has_exact_synonym "hail fall" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:precipitation_process rdfs:subClassOf :material_transport_process ;
    :has_definition "A precipitation process is a process in which a portion of some substance segregates from a material in which that substance or its precursors were dissolved or suspended in and settles due to a force such as gravity or centrifugal force." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:storm rdfs:subClassOf :environmental_system_process ;
    :has_definition "A storm is an environmental process in which an environmental system and the processes it participates in are strongly perturbed by external forcings. These forcings typically increase the rates of processes unfolding in the system, relative to their normal rates." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:atmospheric_storm rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :atmospheric_wind ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_quality ;
                                            owl:someValuesFrom :increased_rate ] ;
                                    rdf:rest :nil ] ] ] ],
        :atmospheric_process,
        :storm ;
    :has_definition "An atmospheric storm is a process in which a portion of an astronomical body's atmosphere is strongly perturbed from its prevaling weather." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:thunderstorm rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :atmospheric_lightning ],
        :convective_storm ;
    :has_definition "An atmospheric storm which occurs in cumulonimbus clouds and during which lightning and thunder occur." ;
    :has_exact_synonym "electrical storm",
        "lightning storm" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:rainstorm rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :water_based_rainfall ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_quality ;
                                            owl:someValuesFrom :increased_rate ] ;
                                    rdf:rest :nil ] ] ] ],
        :atmospheric_storm ;
    :has_definition "An atmospheric storm during which intense rainfall occurs." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hailstorm rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :hailfall ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_quality ;
                                            owl:someValuesFrom :increased_rate ] ;
                                    rdf:rest :nil ] ] ] ],
        :icestorm ;
    :has_definition "An atmospheric storm during which intense hailfall occurs"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:snowstorm rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :snowfall ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_quality ;
                                            owl:someValuesFrom :increased_rate ] ;
                                    rdf:rest :nil ] ] ] ],
        :atmospheric_storm ;
    :has_definition "An atmospheric storm during which intense snowfall occurs." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:icestorm rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_output ;
            owl:someValuesFrom :glaze_ice_layer ],
        [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :freezing_rainfall ],
        :atmospheric_storm ;
    :has_definition "An atmospheric storm during which freezing rain falls and accumulates as ice on exposed surfaces."@en ;
    :has_exact_synonym "glaze event",
        "silver thaw",
        "glaze storm"@en,
        "ice storm"@en,
        "silver storm"@en ;
    :has_related_synonym "glaze event"@en,
        "silver thaw"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:area_of_developed_open_space rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :dense_settlement_biome ],
        [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :atmospheric_boundary_layer ],
        :anthropised_terrestrial_environmental_zone ;
    :alternative_term "developed, open space" ;
    :has_definition "An area of a planet's surface which is primarily covered by cultivated or anthropically maintained vegetation planted for recreation, erosion control, or aesthetic purposes interspersed by constructed or manufactured objects and materials. This area is in contact with an atmospheric column extending from the planetary boundary layer to the planet's exosphere with little to no physical obstruction." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:area_of_developed_space_with_low_usage_intensity rdfs:subClassOf :area_of_developed_space ;
    :alternative_term "developed, low intensity" ;
    :has_definition "An area of a planet's surface which is primarily covered by cultivated or anthropically maintained vegetation and by constructed or manufactured objects and materials covering up to approximately half its extent. Such areas are used for low intensity purposes such as accommodating collections of single-family residential units. This area is in contact with an atmospheric column extending from the planetary boundary layer to the planet's exosphere with little to no physical obstruction." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:area_of_developed_space_with_medium_usage_intensity rdfs:subClassOf :area_of_developed_space ;
    :alternative_term "developed, medium intensity" ;
    :has_definition "An area of a planet's surface which is primarily covered by constructed or manufactured objects and materials covering from half to three-forths of its extent and by cultivated or anthropically maintained vegetation. Such areas are used for medium intensity purposes such as accommodating dense collections of single-family residential units. This area is in contact with an atmospheric column extending from the planetary boundary layer to the planet's exosphere with little to no physical obstruction." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:area_of_developed_space_with_high_usage_intensity rdfs:subClassOf :area_of_developed_space ;
    :alternative_term "developed, high intensity" ;
    :has_definition "An area of developed space used for high intensity purposes such as accommodating dense and multi-occupant residential, commercial, and industrial units. This area is in contact with an atmospheric column extending from the planetary boundary layer to the planet's exosphere with little to no physical obstruction." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:area_of_sedge_and_forb_dominated_herbaceous_vegetation rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :atmospheric_boundary_layer ],
        :vegetated_area ;
    :alternative_term "sedge/herbaceous" ;
    :has_definition "An area of a planet's surface which is primarily covered by sedges or forbs, possibly interpersed with grasses or grass-like plants. This area is in contact with an atmospheric column extending from the planetary boundary layer to the planet's exosphere with little to no physical obstruction." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:area_of_gramanoid_or_herbaceous_vegetation rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :atmospheric_boundary_layer ],
        :grassland_area ;
    :alternative_term "grassland/herbaceous" ;
    :has_definition "An area of a planet's surface which is primarily covered by gramanoid or herbaceous vegetation and which is not subject to intensive management by humans. This area is in contact with an atmospheric column extending from the planetary boundary layer to the planet's exosphere with little to no physical obstruction." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:area_of_lichen_dominated_vegetation rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :atmospheric_boundary_layer ],
        [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :tundra_biome ],
        :vegetated_area ;
    :alternative_term "lichens" ;
    :has_definition "An area of a planet's surface which is primarily covered by fruticose or foliose lichens and which is in contact with an atmospheric column extending from the planetary boundary layer to the planet's exosphere with little to no physical obstruction." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:area_of_moss_dominated_vegetation rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :atmospheric_boundary_layer ],
        :vegetated_area ;
    :alternative_term "moss" ;
    :has_definition "An area of a planet's surface which is primarily covered by mosses and which is in contact with an atmospheric column extending from the planetary boundary layer to the planet's exosphere with little to no physical obstruction." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:area_of_pastureland_or_hayfields rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :ranch ],
        :anthropised_terrestrial_environmental_zone,
        :area_of_gramanoid_or_herbaceous_vegetation ;
    :alternative_term "pasture/hay" ;
    :has_definition "An area of a planet's surface which is partly covered by planted grasses, legumes, or mixtures of grass and legumes and used for livestock grazing or the production of seed or hay crops. This area is in contact with an atmospheric column extending from the planetary boundary layer to the planet's exosphere with little to no physical obstruction." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:area_of_cropland rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :cropland_ecosystem ],
        [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :atmospheric_boundary_layer ],
        :vegetated_area ;
    :alternative_term "cultivated crops" ;
    :has_definition "An area of a planet's surface which is partly covered either by annual crops and perennial woody crops or by actively tilled land. This area is in contact with an atmospheric column extending from the planetary boundary layer to the planet's exosphere with little to no physical obstruction." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:area_of_woody_wetland rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :forested_area ;
                            rdf:rest [ rdf:first :scrubland_area ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :wetland_area ],
        [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :atmospheric_boundary_layer ],
        :wetland_area ;
    :alternative_term "woody wetlands" ;
    :has_definition "An area of a planet's surface which is partly covered by forest or shrubland vegetation and where the underlying soil or substrate is periodically saturated with or covered by water. This area is in contact with an atmospheric column extending from the planetary boundary layer to the planet's exosphere with little to no physical obstruction." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:area_of_emergent_herbaceous_wetland rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :atmospheric_boundary_layer ],
        [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :wetland_ecosystem ],
        :wetland_area ;
    :alternative_term "emergent herbaceous wetlands" ;
    :has_definition "An area of a planet's surface which is primarily covered by perennial herbaceous vegetation and where the underlying soil or substrate is periodically saturated with or covered by water. This area is in contact with an atmospheric column extending from the planetary boundary layer to the planet's exosphere with little to no physical obstruction." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:snowfall rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom :snow ],
        :hydrological_precipitation_process ;
    :has_definition "A hydrological process in which irregular aggregates of snow fall to the surface of an astronomical body." ;
    :has_exact_synonym "snow fall" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:freezing_rainfall rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :surface_layer ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_quality ;
                                            owl:someValuesFrom :decreased_temperature ] ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_output ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :water ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_quality ;
                                            owl:someValuesFrom :frozen ] ;
                                    rdf:rest :nil ] ] ] ],
        :water_based_rainfall ;
    :has_broad_synonym "freezing rain",
        "freezing rain fall" ;
    :has_definition "Water-based rainfall which freezes either 1) on impact with a surface to form a coating of clear ice (glaze) or 2) after percolating through surface layers."@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:electrostatic_discharge_process rdfs:subClassOf :environmental_system_process ;
    :has_definition "A process during which a sudden flow of electricity occurs, often accompanied by a visible release of photons, between two electrically charged objects due to contact, an electrical short, or dielectric breakdown." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:atmospheric_lightning rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_output ;
            owl:someValuesFrom :plasma ],
        [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom :cloud ],
        :atmospheric_process,
        :electrostatic_discharge_process ;
    :has_definition "A sudden electrostatic discharge which occurs during an electrical storm as differentially charged atmospheric entities equalise their charge." ;
    :has_exact_synonym "lightning" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:intercloud_lightning rdfs:subClassOf :lightning_flash ;
    :has_definition "A lightning process during which electrostatic discharge occurs between at least two clouds." ;
    :has_exact_synonym "CC lightning",
        "cloud-cloud lightning" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:intracloud_lightning rdfs:subClassOf :lightning_flash ;
    :has_definition "A lightning process during which electrostatic discharge occurs within a single cloud." ;
    :has_exact_synonym "IC lightning" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lightning_strike rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :planetary_surface ;
                            rdf:rest [ rdf:first [ owl:intersectionOf [ rdf:first :material_entity ;
                                                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                                                    owl:onProperty :adjacent_to ;
                                                                    owl:someValuesFrom :planetary_surface ] ;
                                                            rdf:rest :nil ] ] ] ;
                                    rdf:rest :nil ] ] ] ],
        :atmospheric_lightning ;
    :has_definition "A lightning process during which electrostatic discharge occurs between a cloud and an object on a planetary surface, or a planetary surface itself." ;
    :has_exact_synonym "CG lightning",
        "cloud-ground lightning" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lightning_flash rdfs:subClassOf :atmospheric_lightning ;
    :has_definition "A lightning process during which electrostatic discharge occurs within a single cloud or between multiple clouds." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:blizzard rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :aeolian_transport_of_snow ],
        :snowstorm ;
    :has_definition "A blizzard is a severe snowstorm during which snowfall is transported by strong winds, sustained for several hours."@en ;
    :has_narrow_synonym "boulbie"@en,
        "buran"@en,
        "purga"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ground_blizzard rdfs:subClassOf :atmospheric_storm ;
    :has_definition "A ground blizzard is a storm during which snow which has settled on a planetary surface is resuspended in and transported through its atmosphere by strong winds, sustained for several hours." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:shrimp_pond rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :contains_process ;
            owl:someValuesFrom :crustacean_farming_process ],
        :lentic_water_body ;
    :has_definition "A lentic water body which is used for the artificial culture of shrimp." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:aquaculture_process rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :viridiplantae ;
                            rdf:rest [ rdf:first :metazoa ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :occurs_in ;
            owl:someValuesFrom :water_body ],
        :planned_environmental_usage_process ;
    :has_definition "A process during which humans rear animals or plants in bodies of water for harvest and consumption." ;
    :has_related_synonym "aquatic farming" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:feasting_pit_site rdfs:subClassOf :archeological_site ;
    :has_definition "An archeological site which contains holes humans had dug in the ground, or their remnants, for the purpose of storing and distributing food, drink, and both functional or ritualistic implements during communal eating and drinking." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:geothermally_heated_river rdfs:subClassOf :river ;
    :has_definition "A river which is heated by geothermal processes such as heat exchange with lava or hydrothermal percolation." ;
    :has_related_synonym "boiling river" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:biocrust rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :located_in ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :environmental_system ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_quality ;
                                            owl:someValuesFrom :arid ] ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :ecological_community ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :capable_of ;
                                            owl:someValuesFrom :photosynthesis ] ;
                                    rdf:rest :nil ] ] ] ],
        :solid_surface_layer ;
    :has_definition "A surface layer of a solid environmental material which is formed by the presence and activity of photosynthetic microbial assemblages colonising it." ;
    :has_exact_synonym "biological crust" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:soil_biocrust rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :soil_surface_layer ],
        :biocrust,
        :surface_of_an_astronomical_body ;
    :has_definition "A biocrust which is formed by photosynthetic microbial assemblages colonising the surface layer of a portion of arid soil. Through their successional dynamics, these communities reduce the soil surface's albedo, impart it with stability against erosion, modify its hydrology, and promote its fertility." ;
    :has_exact_synonym "biological soil crust",
        "cryptobiotic soil",
        "cryptogamic soil",
        "microbiotic soil",
        "microphytic soil",
        "soil biological crust" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cloud_condensation_nucleus rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :solid_environmental_material ;
                            rdf:rest [ rdf:first :liquid_environmental_material ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :aerosol ],
        [ a owl:Restriction ;
            owl:onProperty :participates_in ;
            owl:someValuesFrom :nucleation_of_cloud_condensation ],
        :mass_of_environmental_material ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :mass_of_environmental_material ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :participates_in ;
                                    owl:someValuesFrom :nucleation_of_cloud_condensation ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A solid or liquid particle, usually 0.2 micrometers in diameter, on which water vapour condenses, seeding cloud formation." ;
    :has_exact_synonym "CCN",
        "cloud seed" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:nucleation_of_cloud_condensation rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :causally_upstream_of_or_within ;
            owl:someValuesFrom :cloud_formation_process ],
        [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom :water_vapour ],
        [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :material_entity ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_quality ;
                                            owl:someValuesFrom [ owl:unionOf [ rdf:first :quality_of_a_solid ;
                                                            rdf:rest [ rdf:first :quality_of_a_liquid ;
                                                                    rdf:rest :nil ] ] ] ] ;
                                    rdf:rest :nil ] ] ] ],
        :atmospheric_process,
        :hydrological_process ;
    :has_definition "A process during which a solid particle or liquid droplet catalyses the condensation of water vapour in an atmosphere." ;
    :has_exact_synonym "cloud seeding process" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ice_ablation_zone rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :ice_sheet ;
                            rdf:rest [ rdf:first :glacier ;
                                    rdf:rest :nil ] ] ] ],
        :ice_decumulation_zone ;
    :has_broad_synonym "ablation zone" ;
    :has_definition "An environmental zone which overlaps a glacier or an ice sheet, and in which ice loss exceeds ice gain." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ice_loss_process rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :material_transport_process ;
                            rdf:rest [ rdf:first :material_transformation_process ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :melting ;
                            rdf:rest [ rdf:first :sublimation_process ;
                                    rdf:rest [ rdf:first :ice_calving_process ;
                                            rdf:rest :nil ] ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_input ;
            owl:someValuesFrom :ice_mass ],
        [ a owl:Restriction ;
            owl:onProperty :has_output ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :ice_mass ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_quality ;
                                            owl:someValuesFrom :decreased_mass ] ;
                                    rdf:rest :nil ] ] ] ],
        :material_decumulation_process ;
    :has_definition "A material decumulation process during which the mass of an existing ice mass decreases in size." ;
    :has_exact_synonym "ice loss" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:rubbish_landslide rdfs:subClassOf :mass_wasting ;
    :has_definition "A mass wasting process during which refuse from human activities, usually accumulated at a dumping site, falls down a slope under the force of gravity." ;
    :has_exact_synonym "garbage landslide",
        "refuse landslide",
        "trash landslide" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ice_calving_process rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom :ice_mass ],
        :mass_wasting ;
    :has_broad_synonym "calving" ;
    :has_definition "A process during which a part of an ice mass breaks away from the main mass." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:open_animal_house rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :building_envelope ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_quality ;
                                            owl:someValuesFrom :open ] ;
                                    rdf:rest :nil ] ] ] ],
        :animal_house ;
    :has_definition "An animal house which is only partially surrounded by a building envelope." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:glacial_ice_ablation_process rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :occurs_in ;
            owl:someValuesFrom :ice_ablation_zone ],
        :englacial_process,
        :glacial_ice_loss ;
    :has_definition "An ice loss process which occurs in the low-altitude area of a glacier or ice sheet below the firn layer." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:water_ice_sublimation_process rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_output ;
            owl:someValuesFrom :water_vapour ],
        [ a owl:Restriction ;
            owl:onProperty :has_input ;
            owl:someValuesFrom :water_ice ],
        :hydrological_process,
        :sublimation_process ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :sublimation_process ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_input ;
                                    owl:someValuesFrom :water_ice ] ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_output ;
                                            owl:someValuesFrom :water_vapour ] ;
                                    rdf:rest :nil ] ] ] ] ;
    :has_definition "A sublimation process during which water ice transitions into a gaseous state." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:closed_animal_house rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :building_envelope ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_quality ;
                                            owl:someValuesFrom :closed ] ;
                                    rdf:rest :nil ] ] ] ],
        :animal_house ;
    :has_definition "An animal house which has a complete building envelope." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:animal_cage rdfs:subClassOf :manufactured_cage ;
    :has_broad_synonym "cage" ;
    :has_definition "A manufactured cage which may be used to confine, contain, or protect an animal." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:petting_zoo rdfs:subClassOf :zoological_garden ;
    :has_definition "A petting zoo is a zoological garden which contains domesticated non-human animals and some wild non-human animals that are docile enough for humans to touch and feed." ;
    :has_exact_synonym "petting farm" ;
    :has_related_synonym "children's zoo" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:plumbing_drain rdfs:subClassOf :artificial_channel ;
    :has_definition "An artificial channel which transports unwanted water or waste liquids away from their source, either to a more useful area, a receptacle, or into sewers or stormwater mains as waste discharge to be released or processed." ;
    :has_exact_synonym "drain",
        "drainage channel" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:abattoir rdfs:subClassOf :industrial_building ;
    :has_definition "A facility in which non-human animals are slaughtered and processed for human consumption." ;
    :has_exact_synonym "slaughterhouse",
        "slaughter plant"@en ;
    :has_related_synonym "meat processing building",
        "butchery"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:knackery rdfs:subClassOf :industrial_building ;
    :has_definition "A facility in which non-human animals are slaughtered and processed, but not for human consumption." ;
    :has_exact_synonym "knacker's yard" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:day_care_building rdfs:subClassOf :commercial_building ;
    :has_definition "A building which is used to care for a human child during the working day by a person, outside the child's immediate family, other than that child's legal guardians." ;
    :has_exact_synonym "child care building",
        "daycare building"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:fish_processing_building rdfs:subClassOf :food_processing_building ;
    :has_definition "A building in which fish are subject to a series of operations to prepare them for human consumption." ;
    :has_related_synonym "fish factory" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ecological_corridor rdfs:subClassOf :ecosystem ;
    :has_definition "An ecosystem which bridges two or more adjoining ecosystems and through which organisms may move or propagate." ;
    :has_related_synonym "animal corridor",
        "green corridor",
        "habitat corridor",
        "wildlife corridor" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:migration_path rdfs:subClassOf :ecological_corridor ;
    :has_definition "An ecological corridor through which organisms move during a migration process." ;
    :has_exact_synonym "migration corridor" ;
    :has_related_synonym "migratory route" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:nursing_home rdfs:subClassOf :healthcare_facility ;
    :has_broad_synonym "intermediate care facility",
        "long-term care facility",
        "skilled nursing facility",
        "old people's home"@en ;
    :has_definition "A building in which nursing aides and skilled nurses provide care and treatment to residents who have significant difficulty coping with the required activities of daily living." ;
    :has_exact_synonym "care home",
        "convalescent home",
        "rest home" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:residential_building rdfs:subClassOf :human_house ;
    :has_definition "A human house which serves as a long-term shelter for its inhabitants and within which they store personal property." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:restaurant rdfs:subClassOf :commercial_building ;
    :has_definition "A building within which food and drink are prepared and served to customers in exchange for money or other goods and/or services." ;
    :has_exact_synonym "eatery" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:campground rdfs:subClassOf :anthropogenic_geographic_feature ;
    :has_definition "A part of an ecosystem which may be or has been used for one or more overnight stays by humans sheltering in tents, camper vans, caravans, or improvised shelters." ;
    :has_exact_synonym "camping ground",
        "camping pitch",
        "camping site",
        "campsite" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:dedicated_campground rdfs:subClassOf :campground ;
    :has_definition "A campground which has been modified by humans to provide and maintain facilities for camping such as fire pits, road access, latrines, and garbage bins." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:impromptu_campground rdfs:subClassOf :campground ;
    :has_definition "A campground which has no pre-existing facilities installed or maintained by humans, usually found outside of anthropised ecosystems." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hot_tub rdfs:subClassOf :manufactured_product ;
    :has_broad_synonym "spa" ;
    :has_definition "A manufactured product which may hold a volume of heated water suitable for one or more humans to bathe in, usually for the purposes of hydrotherapy or pleasure." ;
    :has_narrow_synonym "Jacuzzi" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:time_crystal rdfs:subClassOf :environmental_material ;
    :has_definition "An open system in non-equilibrium with its environment that exhibits time translation symmetry breaking." ;
    :has_exact_synonym "space-time crystal" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:fissure_water rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :partially_surrounded_by ;
            owl:someValuesFrom :geological_fracture ],
        :liquid_water ;
    :has_definition "Water which is partially contained within a fissure or a geological fracture." ;
    :has_exact_synonym "fracture water" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:planetary_subsurface_zone rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :planetary_surface ],
        [ a owl:Restriction ;
            owl:onProperty :overlaps ;
            owl:someValuesFrom :planetary_structural_layer ],
        :subsurface_zone_of_an_astronomical_body ;
    :has_definition "Regions of a planet which are not exposed to the planet's atmosphere or space, often comprising parts of one or more planetary structural layers." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:continental_subsurface_zone rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :overlaps ;
            owl:someValuesFrom :continental_crust ],
        [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :planetary_landmass ],
        :planetary_subsurface_zone ;
    :has_definition "A region which overlaps parts of one or more planetary structural layers which are located below a continental landmass." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:vegetated_hill rdfs:subClassOf :hill ;
    :has_definition "A hill which has a surface that is partially or wholly covered by plant communities." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:microplastic_particle rdfs:subClassOf :piece_of_plastic ;
    :has_definition "A piece of plastic which has a diameter less than five millimetres." ;
    :has_related_synonym "microplastic" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:primary_microplastic_particle rdfs:subClassOf :microplastic_particle ;
    :has_definition "A microplastic particle which is the direct output of a manufacturing process." ;
    :has_exact_synonym "Primäres Mikroplastik"@de,
        "microplástico primario"@es,
        "microplastica primaria"@it ;
    :has_related_synonym "microplastic" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:secondary_microplastic_particle rdfs:subClassOf :microplastic_particle ;
    :has_definition "A microplastic particle which is derived from the breakdown of larger plastic debris." ;
    :has_exact_synonym "Sekundäres Mikroplastik"@de,
        "microplástico secundario"@es,
        "microplastica secondaria"@it ;
    :has_related_synonym "microplastic" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:ecotone rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :overlaps ;
            owl:someValuesFrom :biome ],
        [ a owl:Restriction ;
            owl:minQualifiedCardinality "2"^^xsd:nonNegativeInteger ;
            owl:onClass :biome ;
            owl:onProperty :has_component ],
        :ecosystem ;
    :has_definition "An envirommental system which bridges two or more biomes and which includes ecological communities which blend these biomes' phylogenetic and phenotypic compositions." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:polar_tree_line_ecotone rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :overlaps ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :tundra_biome ;
                            rdf:rest [ rdf:first :subpolar_coniferous_forest_biome ;
                                    rdf:rest :nil ] ] ] ],
        :tree_line_ecotone ;
    :has_definition "An ecotone which bridges a subpolar coniferous forest biome and a tundra biome." ;
    :has_related_synonym "Arctic tree-line ecotone" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lichen_woodland rdfs:subClassOf :conifer_woodland ;
    :has_definition "A woodland which has an understory partially covered by lichen mats and tundra-like vegetation." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:water_ice_formation_process rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_input ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :liquid_water ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_quality ;
                                            owl:someValuesFrom [ owl:unionOf [ rdf:first :quality_of_a_gas ;
                                                            rdf:rest [ rdf:first :quality_of_a_liquid ;
                                                                    rdf:rest :nil ] ] ] ] ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_output ;
            owl:someValuesFrom :water_ice ],
        [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :freezing ;
                            rdf:rest [ rdf:first :desublimation_of_water_vapour_into_ice ;
                                    rdf:rest :nil ] ] ] ],
        :hydrological_process,
        :material_congelation_process ;
    :has_definition "A material transformation process during which water ice is formed." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:natural_environment rdfs:subClassOf :environmental_system ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :environmental_system ;
                    rdf:rest [ rdf:first [ owl:complementOf [ a owl:Restriction ;
                                            owl:onProperty :formed_as_result_of ;
                                            owl:someValuesFrom :anthropisation ] ] ;
                            rdf:rest :nil ] ] ] ;
    :alternative_term "non-anthropised environment",
        "non-anthropized environment" ;
    :has_definition "An environmental system in which minimal to no anthropisation has occurred and non-human agents are the primary determinants of the system's dynamics and composition." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:anthropisation rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_input ;
            owl:someValuesFrom :natural_environment ],
        [ a owl:Restriction ;
            owl:onProperty :has_output ;
            owl:someValuesFrom :anthropogenic_environment ],
        :anthropogenic_ecosystem_conversion_process ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :anthropogenic_ecosystem_conversion_process ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_input ;
                                    owl:someValuesFrom :natural_environment ] ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_output ;
                                            owl:someValuesFrom :anthropogenic_environment ] ;
                                    rdf:rest :nil ] ] ] ] ;
    :has_definition "A process during which a natural environmental system is altered by human action." ;
    :has_exact_synonym "anthropization" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:tree_line_ecotone rdfs:subClassOf :ecotone ;
    :has_definition "An ecotone which overlaps at least one biome which supports the growth and persistence of trees and at least one that does not. Before ceasing altogether, tree growth becomes sparse and trees appear stunted as conditions become less favourable along this ecotone." ;
    :has_exact_synonym "tree line",
        "tree-line",
        "treeline" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:alpine_tree_line_ecotone rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :elevated_landform ],
        :tree_line_ecotone ;
    :has_definition "A tree line ecotone across which trees cease to grow due to the low temperatures or duration of snow cover that occur at increased elevations above mean sea level." ;
    :has_exact_synonym "alpine tree line",
        "alpine tree-line",
        "alpine treeline" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:desert_tree_line_ecotone rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :overlaps ;
            owl:someValuesFrom :desert_biome ],
        :tree_line_ecotone ;
    :has_definition "A tree line ecotone across which trees cease to grow due to insufficient water availability due to a lack of water-based precipitation." ;
    :has_exact_synonym "desert tree line",
        "desert tree-line",
        "desert treeline" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:desert_alpine_tree_line_ecotone rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :overlaps ;
            owl:someValuesFrom :alpine_tree_line_ecotone ],
        :desert_tree_line_ecotone ;
    :has_definition "A tree line ecotone across which trees cease to grow due to insufficient water availability caused by exposure to increased solar radiation and a lack of rainfall." ;
    :has_exact_synonym "desert-alpine tree line",
        "desert-alpine tree-line",
        "desert-alpine treeline" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:double_tree_line_ecotone rdfs:subClassOf :tree_line_ecotone ;
    :has_definition "A tree line ecotone which contains gaps in tree coverage due to decreased biodiversity in tree-forming plant species: gaps are above the alpine tree line for some species yet below the desert tree line for others, and no species with intermediate tolerances are present." ;
    :has_exact_synonym "double tree line",
        "double tree-line",
        "double treeline" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:terrestrial_planet rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :rock ;
                            rdf:rest [ rdf:first :metallic_material ;
                                    rdf:rest :nil ] ] ] ],
        :planet ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :planet ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :composed_primarily_of ;
                                    owl:someValuesFrom [ owl:unionOf [ rdf:first :rock ;
                                                    rdf:rest [ rdf:first :metallic_material ;
                                                            rdf:rest :nil ] ] ] ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A planet that is composed primarily of silicate rocks or metals." ;
    :has_exact_synonym "rocky planet",
        "telluric planet" ;
    :has_related_synonym "Earth-like planet" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:primary_atmosphere rdfs:subClassOf :planetary_atmosphere ;
    :has_definition "A planetary atmosphere which is formed as a result of the accretion of gaseous matter from the accretion disc of the planet's star." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:secondary_atmosphere rdfs:subClassOf :planetary_atmosphere ;
    :has_definition "A planetary atmosphere which has formed as a result of its planet's volcanic activity, or by accumulation of material from comet impacts." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:tertiary_atmosphere rdfs:subClassOf :planetary_atmosphere ;
    :has_definition "A planetary atmosphere which has formed as a result of biotic processes modifying a secondary atmosphere." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:diatomite rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :aluminium_oxide ],
        [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :silicon_dioxide ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :derives_from ;
                                            owl:someValuesFrom :bacillariophyta ] ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :iron_oxide ],
        [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :diatomaceous_earth ],
        :sedimentary_rock ;
    :has_definition "A sedimentary rock which is primarily composed of the fossilized, siliceous remains of diatoms mixed with varying amounts of other clays and minerals." ;
    :has_exact_synonym "kieselguhr",
        "kieselgur" ;
    :has_related_synonym "D.E.",
        "diatomaceous earth" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:diatomite_particle rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :diatomite ],
        :piece_of_rock ;
    :has_definition "A piece of rock which is primarily composed of diatomite: the fossilized, siliceous remains of diatoms mixed with varying amounts of other clays and minerals." ;
    :has_exact_synonym "kieselguhr particle",
        "kieselgur particle",
        "particle of diatomaceous earth",
        "particle of diatomite",
        "piece of diatomaceous earth",
        "piece of diatomite" ;
    :has_related_synonym "D.E.",
        "diatomaceous earth" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:industrial_wastewater rdfs:subClassOf :waste_water ;
    :has_definition "Wastewater which is produced by industrial activity and which contains chemical contaminants other than those associated with urine and fecal matter." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:constructed_swimming_pool rdfs:subClassOf :human_construction ;
    :has_broad_synonym "pool" ;
    :has_definition "A construction which is designed to hold water in which humans may swim or perform other leisure activities." ;
    :has_exact_synonym "paddling pool",
        "swimming bath",
        "swimming pool",
        "wading pool" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:private_swimming_pool rdfs:subClassOf :constructed_swimming_pool ;
    :has_broad_synonym "pool",
        "swimming pool" ;
    :has_definition "A constructed swimming pool which is owned by a non-governmental legal entity or a collective of such entities." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:public_swimming_pool rdfs:subClassOf :constructed_swimming_pool ;
    :has_broad_synonym "pool",
        "swimming pool" ;
    :has_definition "A constructed swimming pool which is owned by a governmental or state entity." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:water_intake rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :channel_of_a_watercourse ;
                            rdf:rest [ rdf:first :channel ;
                                    rdf:rest :nil ] ] ] ],
        :human_construction ;
    :has_definition "A hydraulic-engineering installation which transports water - in specified amounts, of a specified quality, and in accordance with a water-consumption plan - from a source of supply into a conduit." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cafeteria rdfs:subClassOf :restaurant ;
    :has_definition "A building which provides the site for food services with little or no waiting staff furnishing table service." ;
    :has_related_synonym "canteen"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:delicatessen rdfs:subClassOf :grocery_store ;
    :has_definition "A food shop which sells a selection of food products that are not typical dietary components of the human population it is co-located with." ;
    :has_exact_synonym "deli"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:food_truck rdfs:subClassOf :truck ;
    :has_definition "A truck which is equipped to cook and sell food." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:take_out_restaurant rdfs:subClassOf :restaurant ;
    :has_definition "A restaurant which provides prepared meals or other food products that the purchaser must eat off its premises." ;
    :has_exact_synonym "take out restaurant",
        "take-away" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:kiosk rdfs:subClassOf :commercial_building ;
    :has_definition "A booth with an open window on one side." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:food_kiosk rdfs:subClassOf :kiosk ;
    :has_definition "A kiosk from which food products are sold." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:animal_trap rdfs:subClassOf :manufactured_product ;
    :has_definition "A manufactured product which is designed to catch and hold animals." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pitfall_trap rdfs:subClassOf :animal_trap ;
    :has_definition "An animal trap which consists of a container set flush with the ground such that animals moving along the ground may fall in and be available for examination or collection." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:dry_pitfall_trap rdfs:subClassOf :pitfall_trap ;
    :has_definition "A pitfall trap in which a glass, plastic, or metal container devoid of accumulations of any liquid is used to contain any animal that falls inside." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:wet_pitfall_trap rdfs:subClassOf :pitfall_trap ;
    :has_definition "A pitfall trap in which the container used to hold trapped animals is filled with a liquid solution formulated to hold, kill, and preserve any animal or animals which falls within it." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:channel_of_an_intermittent_river rdfs:subClassOf :channel_of_an_intermittent_stream ;
    :has_definition "A channel of an intermittent stream which contains a river when water supply exceeds evapotranspiration and bed seepage." ;
    :has_exact_synonym "ephemeral river",
        "intermittent river" ;
    :has_related_synonym "temporary river" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:channel_of_an_intermittent_stream rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :contains_process ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :water_flow_process ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_quality ;
                                            owl:someValuesFrom :discontinuous ] ;
                                    rdf:rest :nil ] ] ] ],
        :container_of_an_intermittent_water_body ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :container_of_an_intermittent_water_body ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :contains_process ;
                                    owl:someValuesFrom [ owl:intersectionOf [ rdf:first :water_flow_process ;
                                                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                                                    owl:onProperty :has_quality ;
                                                                    owl:someValuesFrom :discontinuous ] ;
                                                            rdf:rest :nil ] ] ] ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A channel through which a directional flow of water periodically occurs, ceasing when bed seepage or evapotranspiration exceed the available water supply." ;
    :has_exact_synonym "intermittent stream" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mass_liquid_flow rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom :liquid_environmental_material ],
        :mass_fluid_flow ;
    :has_definition "A process whereby a volume of liquid moves due to a disequilibrium of physical forces." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:water_flow_process rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom :liquid_water ],
        :hydrological_process,
        :material_transport_process ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :material_transport_process ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_participant ;
                                    owl:someValuesFrom :liquid_water ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A material transport process during which a volume of liquid water is transported due to a disequilibria in physical forces."@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:technosphere rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :human_construction ],
        [ a owl:Restriction ;
            owl:onProperty :overlaps ;
            owl:someValuesFrom :biosphere ],
        [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :manufactured_product ],
        :astronomical_body_part ;
    :has_definition "A part of an astronomical body which includes, as parts, all the entities which have been constructed or manufactured by humans or their technology and which are within the gravitational sphere of influence of that body." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:grocery_store rdfs:subClassOf :food_shop ;
    :has_definition "A food shop in which food products are the primary offer for sale or trade." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:fairground rdfs:subClassOf :anthropogenic_geographic_feature ;
    :has_definition "A part of an ecosystem which has been allocated to host a gathering of people for multiple entertainment or commercial activities." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:agricultural_fairground rdfs:subClassOf :fairground ;
    :has_definition "A fairground which is used to exhibit agricultural technology, livestock, and farm-related activity." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:market rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :participates_in ;
            owl:someValuesFrom :usage_of_an_environment_for_business ],
        :anthropogenic_geographic_feature ;
    :has_broad_synonym "public market"@en ;
    :has_definition "A part of an ecosystem where people gather for the purchase and sale of provisions, livestock, and other goods." ;
    :has_exact_synonym "bazaar",
        "marketplace",
        "mercado",
        "palengke",
        "souk",
        "tianguis" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ethnic_food_shop rdfs:subClassOf :food_shop ;
    :has_definition "A food shop in which the food products on offer are restricted to those produced in a region and cultural setting other than that of the shop's locality." ;
    :has_exact_synonym "ethnic food store",
        "ethnic speciality shop",
        "ethnic speciality store" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:plumbing_fixture rdfs:subClassOf :manufactured_product ;
    :has_definition "An exchangeable device which can be connected to a plumbing system to deliver and drain water." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:sink_fixture rdfs:subClassOf :plumbing_fixture ;
    :has_definition "A plumbing fixture which is bowl-shaped and used for washing hands, dishwashing, and other purposes." ;
    :has_exact_synonym "hand basin",
        "wash basin" ;
    :has_related_synonym "sink",
        "sinker",
        "washbowl" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bathtub_fixture rdfs:subClassOf :plumbing_fixture ;
    :has_definition "A plumbing fixture which may serve as a container for water in which humans or other animals may bathe." ;
    :has_exact_synonym "bathtub" ;
    :has_related_synonym "bath",
        "tub" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:shower_fixture rdfs:subClassOf :plumbing_fixture ;
    :has_definition "A plumbing fixture within which a human or other animal may bathe under a spray of water." ;
    :has_related_synonym "shower" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:manufacturing_process rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_output ;
            owl:someValuesFrom :manufactured_product ],
        [ a owl:Restriction ;
            owl:onProperty :process_has_causal_agent ;
            owl:someValuesFrom :homo_sapiens ],
        :planned_process ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :planned_process ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_output ;
                                    owl:someValuesFrom :manufactured_product ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A planned process during which raw or recycled materials are transformed into products for use or sale using labour and machines, tools, chemical and biological processing, or formulation." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:planetary_manufacturing_process rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :occurs_in ;
            owl:someValuesFrom :planet ],
        [ a owl:Restriction ;
            owl:onProperty :has_end_location ;
            owl:someValuesFrom :technosphere ],
        :manufacturing_process ;
    :has_definition "A manufacturing process which occurs on a planet." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:dry_river rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :located_in ;
            owl:someValuesFrom :dry_river_valley ],
        :dry_stream ;
    :has_definition "A dry stream channel through which a river had flowed, but now contains no appreciable accumulations of water."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:human_directed_construction_process rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_output ;
            owl:someValuesFrom :human_construction ],
        [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :material_transport_process ],
        [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :material_transformation_process ],
        :anthropogenic_environmental_process,
        :planned_process ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :planned_process ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_output ;
                                    owl:someValuesFrom :human_construction ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An process during which natural or manufactured materials and products are processed and arranged by humans or their technology into structures." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:environmental_system_determined_by_a_quality rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :determined_by ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :entity ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_quality ;
                                            owl:someValuesFrom :quality ] ;
                                    rdf:rest :nil ] ] ] ],
        :environmental_system ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :environmental_system ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :determined_by ;
                                    owl:someValuesFrom [ owl:intersectionOf [ rdf:first :entity ;
                                                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                                                    owl:onProperty :has_quality ;
                                                                    owl:someValuesFrom :quality ] ;
                                                            rdf:rest :nil ] ] ] ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An environmental system which is determined by materials bearing roughly homogeneous qualities." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:environmental_system_determined_by_a_material rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :determined_by ;
            owl:someValuesFrom :environmental_material ],
        :environmental_system ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :environmental_system ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :determined_by ;
                                    owl:someValuesFrom :environmental_material ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An environmental system within which an environmental material strongly influences the system's composition and properties." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:rhizosphere_environment rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :overlaps ;
            owl:someValuesFrom :rhizosphere ],
        [ a owl:Restriction ;
            owl:onProperty :overlaps ;
            owl:someValuesFrom :plant_associated_environment ],
        :environmental_system ;
    :alternative_term "Plant rhizosphere" ;
    :has_definition "An environmental system determined by the presence of a plant rhizosphere." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:environmental_system_determined_by_an_organism rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :determined_by ;
            owl:someValuesFrom :cellular_organisms ],
        :ecosystem ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :environmental_system ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :determined_by ;
                                    owl:someValuesFrom :cellular_organisms ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An environmental system which is determined by a living organism." ;
    :has_related_synonym "host-associated environment" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:plant_associated_environment rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :determined_by ;
            owl:someValuesFrom :viridiplantae ],
        :environmental_system_determined_by_an_organism ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :environmental_system ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :determined_by ;
                                    owl:someValuesFrom :viridiplantae ] ;
                            rdf:rest :nil ] ] ] ;
    :alternative_term "Plant" ;
    :has_broad_synonym "plant environment" ;
    :has_definition "An environmental system determined by a green plant." ;
    :has_exact_synonym "Viridiplantae-associated environment" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:animal_associated_environment rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :determined_by ;
            owl:someValuesFrom :metazoa ],
        :environment_associated_with_an_animal_part_or_small_animal,
        :environmental_system_determined_by_an_organism ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :environmental_system ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :determined_by ;
                                    owl:someValuesFrom :metazoa ] ;
                            rdf:rest :nil ] ] ] ;
    :alternative_term "Animal" ;
    :has_broad_synonym "animal environment" ;
    :has_definition "An environmental system determined by an animal." ;
    :has_exact_synonym "Metazoan-associated environment" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:non_saline_environment rdfs:subClassOf [ owl:complementOf [ a owl:Restriction ;
                    owl:onProperty :composed_primarily_of ;
                    owl:someValuesFrom [ owl:intersectionOf [ rdf:first :environmental_material ;
                                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                                    owl:onProperty :has_increased_levels_of ;
                                                    owl:someValuesFrom :sodium_chloride ] ;
                                            rdf:rest :nil ] ] ] ] ],
        [ owl:complementOf [ a owl:Restriction ;
                    owl:onProperty :has_quality ;
                    owl:someValuesFrom :increased_osmolarity ] ],
        :environmental_system_determined_by_a_quality ;
    :alternative_term "Non-saline" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:groundwater rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :located_in ;
            owl:someValuesFrom :aquifer ],
        :underground_water ;
    :has_definition "Underground water which is located in pore spaces found in rock or unconsolidated deposits such as soil, clay, or gravel." ;
    :has_exact_synonym "ground water" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lunar_rainbow rdfs:subClassOf :rainbow ;
    :has_definition "A lunar rainbow is a rainbow produced by the refraction of light, which has been reflected from a moon's surface, by water droplets in an astronomical body's atmosphere." ;
    :has_exact_synonym "moonbow",
        "white rainbow" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:rainbow rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :overlaps ;
            owl:someValuesFrom :water_droplet ],
        :photometeor ;
    :has_definition "A rainbow is a photometeor which consists of a spectral separation of light, formed as a result of the reflection, refraction, and dispersion of light in water droplets suspended in an astronomical body's atmosphere." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:solar_rainbow rdfs:subClassOf :rainbow ;
    :has_definition "A solar rainbow is a rainbow produced by the refraction of light. which has been emitted by a star, by water droplets in the atmosphere of an astronomical body." ;
    :has_related_synonym "stellar rainbow" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:meteor rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :located_in ;
            owl:someValuesFrom :atmosphere ],
        :object ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :object ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :located_in ;
                                    owl:someValuesFrom :atmosphere ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A meteor is any matter- or energy-based entity which is located in the atmosphere of an astronomical body." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:photometeor rdfs:subClassOf :meteor ;
    :has_definition "A meteor that is primarily composed of light." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hydrometeor rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :liquid_water ;
                            rdf:rest [ rdf:first :water_ice ;
                                    rdf:rest :nil ] ] ] ],
        :meteor ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :meteor ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :composed_primarily_of ;
                                    owl:someValuesFrom [ owl:unionOf [ rdf:first :liquid_water ;
                                                    rdf:rest [ rdf:first :water_ice ;
                                                            rdf:rest :nil ] ] ] ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A meteor which is primarily composed of water." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:light_emitted_by_lightning rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :formed_as_result_of ;
            owl:someValuesFrom :atmospheric_lightning ],
        :photometeor ;
    :has_definition "A photometeor which is formed as a result of sudden electrostatic discharge in the atmosphere." ;
    :has_related_synonym "lightning",
        "lightning flash" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lithometeor rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :derives_from ;
            owl:someValuesFrom :meteoroid ],
        :meteor,
        :piece_of_rock ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :meteor ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :composed_primarily_of ;
                                    owl:someValuesFrom :rock ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A meteor which is primarily composed of rock." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:reflection_rainbow rdfs:subClassOf :rainbow ;
    :has_definition "A rainbow which forms from sunlight which has been reflected off a body of water prior to its interaction with water droplets in an atmosphere." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:monochrome_solar_rainbow rdfs:subClassOf :solar_rainbow ;
    :has_definition "A solar rainbow which is formed by a narrow band of wavelengths, the rest of the spectrum having been scattered away by an atmosphere." ;
    :has_exact_synonym "monochrome rainbow",
        "red rainbow" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:fogbow rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :overlaps ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :cloud ;
                            rdf:rest [ rdf:first :fog ;
                                    rdf:rest :nil ] ] ] ],
        :rainbow ;
    :has_definition "A rainbow which forms through the interaction of sunlight with the water droplets which constitute fog or clouds; light is diffracted by these droplets such that the photometeor appears almost white with faint reds on the sky-facing side and faint blues on the planet-facing side of the bow." ;
    :has_exact_synonym "fog bow" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:glory rdfs:subClassOf :photometeor ;
    :has_definition "A photometeor which is formed by wave interference of light refracted within water droplets which constitute mist or clouds and consists of one or more concentric, successively dimmer rings, each of which has red wavelengths distant to the glory's centre and blue wavelengths towards the centre." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:halo rdfs:subClassOf :photometeor ;
    :has_definition "A photometeor which is produced by light that is reflected, refracted, and dispersed by ice crystals, capable of acting as prisms and mirrors, suspended in an astronomical body's atmosphere." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hypereutrophic_water rdfs:subClassOf :eutrophic_water ;
    :has_definition "Water which has a very high concentration of nutrients." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hypereutrophic_lake rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :hypereutrophic_water ],
        :eutrophic_lake ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :eutrophic_lake ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :composed_primarily_of ;
                                    owl:someValuesFrom :hypereutrophic_water ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A lake which is composed primarily of water with very high nutrient concentrations." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hypersaline_lake rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :hypersaline_water ],
        :saline_lake ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :saline_lake ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :composed_primarily_of ;
                                    owl:someValuesFrom :hypersaline_water ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A lake which is primarily composed of water with a concentration of dissolved salts greater than that of ocean water." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:humic_lake rdfs:subClassOf :lake ;
    :has_definition "A lake which is composed primarily water with high concentrations of humic substances and organic acids, resulting in brown- or tea-coloured colouration." ;
    :has_exact_synonym "dystrophic lake" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:natural_lake rdfs:subClassOf [ owl:complementOf :artificial_lake ],
        :lake ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :lake ;
                    rdf:rest [ rdf:first [ owl:complementOf [ a owl:Restriction ;
                                            owl:onProperty :formed_as_result_of ;
                                            owl:someValuesFrom :anthropisation ] ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A lake which has formed as the result of processes that are not or are only minimally driven by human activity." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:radiation rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom :environmental_material ],
        [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom :subatomic_particle ],
        :energy_transfer_process ;
    :has_definition "A process during which energy is emitted or transmitted in the form of waves or particles through space or a material medium." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:particle_radiation rdfs:subClassOf :radiation ;
    :has_definition "A radiation process during which energy is transmitted or emitted by means of fast-moving subatomic particles." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:particle_beam_radiation rdfs:subClassOf :particle_radiation ;
    :has_definition "A particle radiation process during which subatomic particles move in the same direction." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:electromagnetic_radiation rdfs:subClassOf :radiation ;
    :has_definition "A radiation process during which waves (or their quanta, photons) of the electromagnetic field propagate (radiate) through space carrying electromagnetic energy." ;
    :has_exact_synonym "EM radiation" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acoustic_radiation rdfs:subClassOf :radiation ;
    :has_definition "A radiation process during which mechanical waves generated by oscillations radiate through an environmental material." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:sediment_permeated_by_freshwater rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :surrounded_by ;
            owl:someValuesFrom :fresh_water ],
        :sediment ;
    :has_definition "Sediment which has its porespace filled by water which has very low levels of sodium chloride and/or other salts." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:fecal_environment rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :determined_by ;
            owl:someValuesFrom :fecal_material ],
        :environmental_system_determined_by_a_material ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :environmental_system ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :determined_by ;
                                    owl:someValuesFrom :fecal_material ] ;
                            rdf:rest :nil ] ] ] ;
    :alternative_term "Animal distal gut" ;
    :has_definition "An environmental system which has its properties and dynamics determined by feces." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:environment_determined_by_a_metazoan_secretion rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :determined_by ;
            owl:someValuesFrom :secretion_of_exocrine_gland ],
        :anatomical_entity_environment,
        :ecosystem ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :environmental_system ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :determined_by ;
                                    owl:someValuesFrom :secretion_of_exocrine_gland ] ;
                            rdf:rest :nil ] ] ] ;
    :alternative_term "Animal secretion" ;
    :has_definition "An environmental system which has its properties and dynamics determined by a bodily secretion of a metazoan." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:environment_determined_by_a_plant_substance rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :determined_by ;
            owl:someValuesFrom :portion_of_plant_substance ],
        :environment_associated_with_a_plant_part_or_small_plant ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :environmental_system ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :determined_by ;
                                    owl:someValuesFrom :portion_of_plant_substance ] ;
                            rdf:rest :nil ] ] ] ;
    :alternative_term "Plant secretion" ;
    :has_definition "An environmental system which has its properties and dynamics determined by a substance produced by a plant." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:environment_determined_by_a_biofilm_on_a_plant_surface rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :determined_by ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :biofilm_material ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :adjacent_to ;
                                            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :surface_layer ;
                                                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                                                            owl:onProperty :part_of ;
                                                                            owl:someValuesFrom :whole_plant ] ;
                                                                    rdf:rest :nil ] ] ] ] ;
                                    rdf:rest :nil ] ] ] ],
        :ecosystem,
        :environmental_system_determined_by_a_material ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :ecosystem ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :determined_by ;
                                    owl:someValuesFrom [ owl:intersectionOf [ rdf:first :biofilm_material ;
                                                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                                                    owl:onProperty :adjacent_to ;
                                                                    owl:someValuesFrom [ owl:intersectionOf [ rdf:first :surface_layer ;
                                                                                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                                                                                    owl:onProperty :part_of ;
                                                                                                    owl:someValuesFrom :whole_plant ] ;
                                                                                            rdf:rest :nil ] ] ] ] ;
                                                            rdf:rest :nil ] ] ] ] ;
                            rdf:rest :nil ] ] ] ;
    :alternative_term "Plant surface" ;
    :has_definition "An environmental system which has its properties and dynamics determined by a biofilm on the surface of a plant." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:digestive_tract_environment rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :determined_by ;
            owl:someValuesFrom :digestive_tract ],
        :anatomical_entity_environment,
        :ecosystem ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :environmental_system ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :determined_by ;
                                    owl:someValuesFrom :digestive_tract ] ;
                            rdf:rest :nil ] ] ] ;
    :alternative_term "Animal proximal gut" ;
    :has_definition "An environmental system which has its properties and dynamics determined by a digestive tract." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:environment_determined_by_a_biofilm_on_an_animal_surface rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :determined_by ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :biofilm_material ;
