            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :environmental_material ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_quality ;
                                            owl:someValuesFrom :quality_of_a_liquid ] ;
                                    rdf:rest :nil ] ] ] ],
        :aerosol ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :aerosol ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :composed_primarily_of ;
                                    owl:someValuesFrom [ owl:intersectionOf [ rdf:first :environmental_material ;
                                                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                                                    owl:onProperty :has_quality ;
                                                                    owl:someValuesFrom :quality_of_a_liquid ] ;
                                                            rdf:rest :nil ] ] ] ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An aerosol which has non-gaseous parts that are primarily composed of liquid droplets."^^xsd:string ;
    :has_exact_synonym "liquid aerosol" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:aerosolised_solids rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :quality_of_a_solid ;
                            rdf:rest [ rdf:first :quality_of_a_liquid ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :environmental_material ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_quality ;
                                            owl:someValuesFrom :quality_of_a_solid ] ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :surrounded_by ;
            owl:someValuesFrom :air ],
        :aerosol ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :aerosol ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :composed_primarily_of ;
                                    owl:someValuesFrom [ owl:intersectionOf [ rdf:first :environmental_material ;
                                                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                                                    owl:onProperty :has_quality ;
                                                                    owl:someValuesFrom :quality_of_a_solid ] ;
                                                            rdf:rest :nil ] ] ] ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An aerosol which has non-gaseous parts that are primarily composed of solid particles."^^xsd:string ;
    :has_exact_synonym "solid aerosol" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:formation_of_a_solid_aerosol_from_gaseous_material_in_an_atmosphere rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_input ;
            owl:someValuesFrom :gaseous_environmental_material ],
        :formation_of_a_solid_aerosol_in_an_atmosphere ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :formation_of_a_solid_aerosol_in_an_atmosphere ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_input ;
                                    owl:someValuesFrom :gaseous_environmental_material ] ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_output ;
                                            owl:someValuesFrom :aerosolised_solids ] ;
                                    rdf:rest :nil ] ] ] ] ;
    :has_broad_synonym "atmospheric formation of a solid aerosol",
        "formation of a solid aerosol in an atmosphere",
        "formation of a solid aerosol in the atmosphere" ;
    :has_definition "A process during which microscopic solid particulates are formed from gaseous materials in an atmosphere." ;
    :has_related_synonym "formation of solid particles from gaseous material in an atmosphere" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:formation_of_a_liquid_aerosol_from_gaseous_material_in_an_atmosphere rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_input ;
            owl:someValuesFrom :gaseous_environmental_material ],
        :formation_of_a_liquid_aerosol_in_an_atmosphere ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :formation_of_a_liquid_aerosol_in_an_atmosphere ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_input ;
                                    owl:someValuesFrom :gaseous_environmental_material ] ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_output ;
                                            owl:someValuesFrom :aerosolised_liquids ] ;
                                    rdf:rest :nil ] ] ] ] ;
    :has_definition "A process during which microscopic liquid droplets are formed from gaseous materials in an atmosphere." ;
    :has_exact_synonym "atmospheric formation of a liquid aerosol",
        "formation of a liquid aerosol in an atmosphere",
        "formation of a liquid aerosol in the atmosphere" ;
    :has_related_synonym "formation of liquid droplets from gaseous material in an atmosphere",
        "formation of liquid particles from gaseous material in an atmosphere" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:tectonic_lake rdfs:subClassOf [ owl:intersectionOf [ rdf:first [ a owl:Restriction ;
                            owl:onProperty :contained_in ;
                            owl:someValuesFrom :depressed_landform ] ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :formed_as_result_of ;
                                    owl:someValuesFrom :tectonic_movement ] ;
                            rdf:rest :nil ] ] ],
        :lake ;
    :has_definition "A lake which is contained in a depression formed by the deformation and resulting lateral and vertical movements of a lithosphere." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:tectonic_movement rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom :tectonic_plate ],
        :material_transport_process ;
    :has_definition "A process during which pieces of a planetary crust and uppermost mantle move." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:convergent_tectonic_movement rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part_that_occurs_in ;
            owl:someValuesFrom :convergent_plate_boundary ],
        :tectonic_movement ;
    :has_definition "A process during which pieces of a planetary crust and uppermost mantle move towards one another." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:divergent_tectonic_movement rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part_that_occurs_in ;
            owl:someValuesFrom :divergent_plate_boundary ],
        :tectonic_movement ;
    :has_definition "A process during which pieces of a planetary crust and uppermost mantle move away from one another." ;
    :has_exact_synonym "constructive tectonic movement",
        "extensional tectonic movement" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:transform_tectonic_movement rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part_that_occurs_in ;
            owl:someValuesFrom :transform_plate_boundary ],
        :tectonic_movement ;
    :has_definition "A process during which pieces of a planetary crust and uppermost mantle move along each other in a predominantly horizontal manner, either in a sinistral (left lateral) or dextral (right lateral) direction." ;
    :has_exact_synonym "conservative tectonic movement" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:tectonic_plate rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :platelike ],
        [ a owl:Restriction ;
            owl:onProperty :overlaps ;
            owl:someValuesFrom :tectonic_plate_boundary ],
        [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :lithosphere ],
        :solid_astronomical_body_part ;
    :has_definition "A part of a lithosphere which is separated by other such parts by geographic faults or similar geomorphological discontinuities." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:tectonic_plate_boundary rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :overlaps ;
            owl:someValuesFrom :tectonic_plate ],
        [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :linear ],
        [ a owl:Restriction ;
            owl:minQualifiedCardinality "2"^^xsd:nonNegativeInteger ;
            owl:onClass :tectonic_plate ;
            owl:onProperty :has_component ],
        [ a owl:Restriction ;
            owl:onProperty :formed_as_result_of ;
            owl:someValuesFrom :tectonic_movement ],
        :environmental_zone ;
    :has_definition "A geomorphological feature which is formed where two or more tectonic plates move towards, away from, or along one another, resulting in deformation of the lithosphere." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:divergent_plate_boundary rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :contains_process ;
            owl:someValuesFrom :divergent_tectonic_movement ],
        :tectonic_plate_boundary ;
    :has_definition "A geomorphological feature which is formed where two or more tectonic plates are actively moving away from one another, resulting in deformation of the lithosphere that forms rifts or ridges." ;
    :has_exact_synonym "constructive boundary",
        "constructive plate boundary",
        "divergent boundary",
        "extensional boundary",
        "extensional plate boundary" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:convergent_plate_boundary rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :contains_process ;
            owl:someValuesFrom :tectonic_plate_subduction ],
        :tectonic_plate_boundary ;
    :has_definition "A geomorphological feature which is formed where two or more tectonic plates are actively moving towards one another, resulting in deformation of the lithosphere that forces one plate below the other where it melts in the mantle." ;
    :has_exact_synonym "convergent boundary",
        "destructive boundary",
        "destructive plate boundary" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:transform_plate_boundary rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :contains_process ;
            owl:someValuesFrom :transform_tectonic_movement ],
        :tectonic_plate_boundary ;
    :has_definition "A geomorphological feature which is formed where two or more tectonic plates are actively moving along one another in either a sinistral (left lateral) or dextral (right lateral) horizontal direction." ;
    :has_exact_synonym "transform boundary" ;
    :has_related_synonym "transform fault" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:tectonic_plate_subduction rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom [ a owl:Restriction ;
                    owl:onProperty :part_of ;
                    owl:someValuesFrom :planetary_mantle ] ],
        :convergent_tectonic_movement ;
    :has_definition "A convergent tectonic movement process during which one plate moves under another and is forced or sinks due to gravity into a mantle." ;
    :has_exact_synonym "subduction" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:detritus rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom :granular ],
        :organic_material ;
    :has_definition "An organic material which is primarily composed of dead particulate matter."@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:rift_zone rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :contains_process ;
            owl:someValuesFrom :divergent_tectonic_movement ],
        :compound_astronomical_body_part ;
    :has_definition "A compound astronomical body part in which extensional tectonic processes occur and where the lithosphere is being pulled apart." ;
    :has_exact_synonym "rift" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:aeolian_lake rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :formed_as_result_of ;
            owl:someValuesFrom :aeolian_transport_process ],
        :lake ;
    :has_definition "A lake which fills a basin that has been dammed by wind-blown sand,  formed between sand dunes oriented by winds; or formed by wind action under previously arid paleoenvironments." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:landslide_lake rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :formed_as_result_of ;
            owl:someValuesFrom :landslide_process ],
        [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :landslide ],
        :lake ;
    :has_definition "A lake which fills a depression where drainage is blocked by solid material transported by a landslide." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:rockslide_lake rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :adjacent_to ;
            owl:someValuesFrom :rockfall ],
        [ a owl:Restriction ;
            owl:onProperty :formed_as_result_of ;
            owl:someValuesFrom :rockslide_process ],
        :landslide_lake ;
    :has_definition "A lake which fills a depression where drainage is blocked by solid material transported by a rockslide." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:rockslide_process rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_participant ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :solid_environmental_material ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :composed_primarily_of ;
                                            owl:someValuesFrom :rock ] ;
                                    rdf:rest :nil ] ] ] ],
        :landslide_process ;
    :has_definition "A rockslide is a process whereby a large mass of rock moves down a hill or a mountainside." ;
    :has_exact_synonym "rockslip" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:karman_vortex_street rdfs:subClassOf [ owl:unionOf [ rdf:first :aeroform ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :composed_primarily_of ;
                                    owl:someValuesFrom :hydroform ] ;
                            rdf:rest :nil ] ] ],
        :fluid_astronomical_body_part ;
    :has_definition "A succession of swirling vortices caused by the unsteady separation of flow of a fluid around one or more blunt bodies." ;
    :has_exact_synonym "Kármán vortex street",
        "von Kármán vortex street" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ecosystem rdfs:subClassOf :environmental_system ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :environmental_system ;
                    rdf:rest [ rdf:first [ owl:unionOf [ rdf:first [ a owl:Restriction ;
                                                    owl:onProperty :has_part ;
                                                    owl:someValuesFrom :cellular_organisms ] ;
                                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                                            owl:onProperty :has_part ;
                                                            owl:someValuesFrom :collection_of_organisms ] ;
                                                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                                                    owl:onProperty :determined_by ;
                                                                    owl:someValuesFrom :cellular_organisms ] ;
                                                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                                                            owl:onProperty :determined_by ;
                                                                            owl:someValuesFrom :collection_of_organisms ] ;
                                                                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                                                                    owl:onProperty :determined_by ;
                                                                                    owl:someValuesFrom :plant_anatomical_entity ] ;
                                                                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                                                                            owl:onProperty :determined_by ;
                                                                                            owl:someValuesFrom :anatomical_entity ] ;
                                                                                    rdf:rest :nil ] ] ] ] ] ] ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An environmental system which includes both living and non-living components." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:fossil_worm_burrow rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :formed_as_result_of ;
            owl:someValuesFrom :fossilization_of_organic_material ],
        :channel ;
    :has_definition "A channel which was formed as a result of an annelid burrowing through soil, where organic residues lining the burrow have subsequently initiated fossilization." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:fossilization_of_organic_material rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_output ;
            owl:someValuesFrom :mineral_material ],
        [ a owl:Restriction ;
            owl:onProperty :has_input ;
            owl:someValuesFrom :organic_material ],
        :environmental_system_process ;
    :has_broad_synonym "fossilization" ;
    :has_definition "A process during which organic substances are replaced with mineral substrances, maintaining part of their anatomical organisation." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:forage_material rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :plant_matter ],
        :agricultural_environmental_material ;
    :has_broad_synonym "forage" ;
    :has_definition "Material which is primarily conposed of the vegetation present in tended pastures: mainly grasses, with an interspersion of legumes and other forbs." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:feed_storage_space rdfs:subClassOf :agricultural_ecosystem ;
    :has_definition "A physical space, which may or may not be in a construction, which is used to store animal feed for agricultural purposes." ;
    :has_related_synonym "feed storage" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:manure_storage_space rdfs:subClassOf :agricultural_ecosystem ;
    :has_definition "A physical space, which may or may not be in a construction, which is used to store animal manure for agricultural purposes." ;
    :has_related_synonym "manure storage" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bovine_dairy_liquid_manure rdfs:subClassOf :animal_manure ;
    :has_definition "Manure which has been collected directly or indirectly from dairy cattle, as from flushing of manure from concrete feed lanes, free stalls, and milking facilities." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:poultry_manure rdfs:subClassOf :animal_manure ;
    :has_definition "Manure which is composed primarily of the feces of poultry." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:heat_treated_animal_manure rdfs:subClassOf :animal_manure ;
    :has_definition "Manure which has been subjected to heat treatment for solidification and/or sterilization purposes." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:composted_animal_manure rdfs:subClassOf :animal_manure ;
    :has_definition "Manure which has been subjected to a natural process of 'rotting' or decomposition of its organic matter content by microorganisms under controlled conditions." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:animal_manure_product rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :animal_manure ],
        :manufactured_product ;
    :has_definition "A product which is composed primarily of animal manure that has been heat treated and packaged as a product for commercial or consumer use." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:plant_matter rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :plant_anatomical_entity ],
        :organic_material,
        :solid_environmental_material ;
    :has_definition "Organic material which is primarily composed of plant structures, living or dead." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:gas_planet rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :astrogeological_gas ],
        [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first [ owl:unionOf [ rdf:first :hydrogen_molecular_entity ;
                                            rdf:rest [ rdf:first :helium_molecular_entity ;
                                                    rdf:rest :nil ] ] ] ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_quality ;
                                            owl:someValuesFrom :quality_of_a_gas ] ;
                                    rdf:rest :nil ] ] ] ],
        :mass_of_environmental_material,
        :planet ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :planet ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :composed_primarily_of ;
                                    owl:someValuesFrom [ owl:intersectionOf [ rdf:first [ owl:unionOf [ rdf:first :hydrogen_molecular_entity ;
                                                                    rdf:rest [ rdf:first :helium_molecular_entity ;
                                                                            rdf:rest :nil ] ] ] ;
                                                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                                                    owl:onProperty :has_quality ;
                                                                    owl:someValuesFrom :quality_of_a_gas ] ;
                                                            rdf:rest :nil ] ] ] ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A planet which is primarily composed of hydrogen and helium." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:dwarf_gas_planet rdfs:subClassOf :gas_planet ;
    :has_definition "A gas planet which 1) is considerably smaller than a gas giant and 2) has a rocky core around which a thick envelope primarily composed of hydrogen, helium, and smaller proportions of volatiles." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:giant_gas_planet rdfs:subClassOf :gas_planet ;
    :has_definition "A gas planet which has mass and size comparable to Jupiter and Saturn." ;
    :has_exact_synonym "gas giant" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ice rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_quality ;
            owl:someValuesFrom [ owl:unionOf [ rdf:first :quality_of_a_solid ;
                            rdf:rest [ rdf:first :frozen ;
                                    rdf:rest :nil ] ] ] ],
        :environmental_material ;
    :has_definition "An ice is an environmental material which is either frozen or which is maintained in a solid state by gravitational forces or pressure." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:astrogeological_ice rdfs:subClassOf :volatile_astrogeological_material ;
    :has_definition "An astrogeological volatile which is composed primarily of chemical compounds with freezing points above an approximate threshold of 100 Kelvin." ;
    :has_related_synonym "ice" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ice_giant rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :astrogeological_ice ],
        :mass_of_environmental_material,
        :planet ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :planet ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :composed_primarily_of ;
                                    owl:someValuesFrom :astrogeological_ice ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A giant planet which is primarily composed of elements heavier than hydrogen and helium, volatile chemical compounds with freezing points above about 100 Kelvin." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mini_neptune rdfs:subClassOf :gas_planet ;
    :has_definition "A gas planet which has an atmosphere composed of hydrogen and helium  - probably with deep layers of ice, rock or liquid oceans (made of water, ammonia, a mixture of both, or heavier volatiles) - and a small core made of low-density volatiles." ;
    :has_related_synonym "transitional planet" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:super_jupiter rdfs:subClassOf :astronomical_body ;
    :has_definition "An astronomical object which is more massive than the planet Jupiter." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:gravitational_motion rdfs:subClassOf :environmental_system_process ;
    :has_definition "A process during which one or more entities move along geodesics in a region of spacetime that has been sufficiently curved towards an entity with sufficient mass and/or energy." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hot_jupiter rdfs:subClassOf :giant_gas_planet ;
    :has_definition "A giant gas planet which has a jovian-scale mass (0.36–11.8 Jupiter masses), a short orbital period (1.3–111 Earth days), and which is close to the star it orbits, resulting in extreme and exotic atmospheric properties." ;
    :has_exact_synonym "epistellar jovian",
        "pegasean planet",
        "pegasid",
        "roaster planet" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hot_neptune rdfs:subClassOf :gas_planet ;
    :has_definition "A gas planet which has a mass similar to that of Neptune or Uranus and which closely orbits its star (normally at a distance less than 1 Astronomical Unit)." ;
    :has_exact_synonym "hoptune" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mega_earth rdfs:subClassOf :terrestrial_planet ;
    :has_definition "A terrestrial exoplanet which is at least ten times the mass of Earth." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:super_earth rdfs:subClassOf :terrestrial_planet ;
    :has_definition "A terrestrial planet which has a mass higher than Earth's, but substantially below the masses of Uranus and Neptune (15 and 17 Earth masses, respectively)." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:desert_planet rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :planetary_surface ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :composed_primarily_of ;
                                            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :desert ;
                                                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                                                            owl:onProperty :has_quality ;
                                                                            owl:someValuesFrom :increased_temperature ] ;
                                                                    rdf:rest :nil ] ] ] ] ;
                                    rdf:rest :nil ] ] ] ],
        :terrestrial_planet ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :terrestrial_planet ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_part ;
                                    owl:someValuesFrom [ owl:intersectionOf [ rdf:first :planetary_surface ;
                                                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                                                    owl:onProperty :composed_primarily_of ;
                                                                    owl:someValuesFrom [ owl:intersectionOf [ rdf:first :desert ;
                                                                                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                                                                                    owl:onProperty :has_quality ;
                                                                                                    owl:someValuesFrom :increased_temperature ] ;
                                                                                            rdf:rest :nil ] ] ] ] ;
                                                            rdf:rest :nil ] ] ] ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A terrestrial planet which has a surface dominated by hot deserts." ;
    :has_exact_synonym "dry planet" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ocean_planet rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :planetary_surface ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :composed_primarily_of ;
                                            owl:someValuesFrom :liquid_water ] ;
                                    rdf:rest :nil ] ] ] ],
        :planet ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :planet ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_part ;
                                    owl:someValuesFrom [ owl:intersectionOf [ rdf:first :planetary_surface ;
                                                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                                                    owl:onProperty :composed_primarily_of ;
                                                                    owl:someValuesFrom :liquid_water ] ;
                                                            rdf:rest :nil ] ] ] ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A planet which has a surface layer that nearly completely or completely covered by water, and which has a substantial portion of its mass composed of water." ;
    :has_exact_synonym "aquaplanet",
        "panthalassic planet",
        "water world" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ice_planet rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :planetary_surface ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :composed_primarily_of ;
                                            owl:someValuesFrom :ice ] ;
                                    rdf:rest :nil ] ] ] ],
        :planet ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :planet ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_part ;
                                    owl:someValuesFrom [ owl:intersectionOf [ rdf:first :planetary_surface ;
                                                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                                                    owl:onProperty :composed_primarily_of ;
                                                                    owl:someValuesFrom :ice ] ;
                                                            rdf:rest :nil ] ] ] ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A planet which has a surface layer that nearly completely or completely covered by ice, and which has a substantial portion of its mass composed of ice." ;
    :has_exact_synonym "cryoplanet" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:carbon_dioxide_ice rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :carbon_dioxide ],
        :ice ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :ice ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :composed_primarily_of ;
                                    owl:someValuesFrom :carbon_dioxide ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "Ice which is primarily composed of carbon dioxide."^^xsd:string ;
    :has_related_synonym "dry ice" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:methane_ice rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :methane ],
        :hydrocarbon_based_environmental_material,
        :ice ;
    :has_definition "Ice which is primarily composed of methane."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:ammonia_ice rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :ammonia ],
        :ice ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :ice ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :composed_primarily_of ;
                                    owl:someValuesFrom :ammonia ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "Ice which is primarily composed of ammonia."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:carbon_monoxide_ice rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :composed_primarily_of ;
            owl:someValuesFrom :carbon_monoxide ],
        :ice ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :ice ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :composed_primarily_of ;
                                    owl:someValuesFrom :carbon_monoxide ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "Ice which is primarily composed of carbon monoxide."^^xsd:string .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:iron_planet rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :planetary_mantle ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_quality ;
                                            owl:someValuesFrom [ owl:unionOf [ rdf:first :decreased_size ;
                                                            rdf:rest [ rdf:first :decreased_mass ;
                                                                    rdf:rest :nil ] ] ] ] ;
                                    rdf:rest :nil ] ] ] ],
        [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :planetary_core ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :composed_primarily_of ;
                                            owl:someValuesFrom [ owl:unionOf [ rdf:first :iron_atom ;
                                                            rdf:rest [ rdf:first :iron_molecular_entity ;
                                                                    rdf:rest :nil ] ] ] ] ;
                                    rdf:rest :nil ] ] ] ],
        :terrestrial_planet ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :terrestrial_planet ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_part ;
                                    owl:someValuesFrom [ owl:intersectionOf [ rdf:first :planetary_mantle ;
                                                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                                                    owl:onProperty :has_quality ;
                                                                    owl:someValuesFrom [ owl:unionOf [ rdf:first :decreased_size ;
                                                                                    rdf:rest [ rdf:first :decreased_mass ;
                                                                                            rdf:rest :nil ] ] ] ] ;
                                                            rdf:rest :nil ] ] ] ] ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :has_part ;
                                            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :planetary_core ;
                                                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                                                            owl:onProperty :composed_primarily_of ;
                                                                            owl:someValuesFrom [ owl:unionOf [ rdf:first :iron_atom ;
                                                                                            rdf:rest [ rdf:first :iron_molecular_entity ;
                                                                                                    rdf:rest :nil ] ] ] ] ;
                                                                    rdf:rest :nil ] ] ] ] ;
                                    rdf:rest :nil ] ] ] ] ;
    :has_definition "A planet which in primarily composed of an iron-rich core with little to no mantle" ;
    :has_exact_synonym "cannonball planet" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lava_planet rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom [ owl:intersectionOf [ rdf:first :planetary_surface ;
                            rdf:rest [ rdf:first [ a owl:Restriction ;
                                            owl:onProperty :composed_primarily_of ;
                                            owl:someValuesFrom :lava ] ;
                                    rdf:rest :nil ] ] ] ],
        :planet ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :planet ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_part ;
                                    owl:someValuesFrom [ owl:intersectionOf [ rdf:first :planetary_surface ;
                                                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                                                    owl:onProperty :composed_primarily_of ;
                                                                    owl:someValuesFrom :lava ] ;
                                                            rdf:rest :nil ] ] ] ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A planet which has a surface layer that nearly completely or completely covered by lava, and which has a substantial portion of its mass composed of lava." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:sub_earth rdfs:subClassOf :terrestrial_planet ;
    :has_definition "A terrestrial planet which has a mass smaller than Earth's, such that 1) it lacks a magnetic field strong enough to shield its atmosphere from erosion by stellar wind and 2) it has comparatively short periods of geological activity unless it is subject to gravitational tidal forces from a much more massive object." .
